","https://www.thairung.co.th","https://www.ultra.com.br","https://puraniumenergy.com","https://www.vicom.com.sg","https://www.wtfglimited.com"],"shape":[139],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["NS United Kaiun Kaisha, Ltd., together with its subsidiaries, owns and operates land and sea transportation vessels. The company operates through International Shipping and Coastal Shipping segments. It also operates as a shipping agent for land, air, and marine transportation. The company provides iron ore and coking coal transportation services; energy resources transport services; and tramp chartering services. In addition, it engages in the sale, lease, repair, and maintenance of vessels; manufacture, sale, and maintenance of shipping equipment; real estate operations; personnel placement agency operations; and property and life insurance agency operations, as well as in the provision of data-processing and business information services. The company operates in Japan, rest of Asia, Brazil, Europe, the Middle East, North America, South America, Australia, and internationally. As of March 31, 2020, it operated a fleet of 197 vessels. The company was founded in 1950 and is headquartered in Tokyo, Japan.","Mirai Industry Co.,Ltd. manufactures and sells electrical equipment materials in Japan. The company provides fire protection materials; tools; underground and protective pipes; CD, PF, and flexible tubes; resins; cable support insert; retractable covers; mall; vinyl conduit accessories; mounting plates; mirai panel; air conditioner piping materials; and duct, lighting, support bracket, and cable rack, as well as iron, slide, pool, wall, and electricity meter boxes. It also offers pipework equipment, such as drainage related; fire protection materials; water supply and hot water supply reform; gas/kerosene reform and plumbing related; air-conditioning related, insert, and burial related; tool; resin pipe; scabbard and resin pipes; around the header; fittings; faucet box; bathroom parts; reheating; snow melting; heating; and others products. Mirai Industry Co.,Ltd. was incorporated in 1965 and is based in Wanouchi, Japan.","Civitas Resources, Inc., an exploration and production company, focuses on the acquisition, development, and production of oil and natural gas in the Rocky Mountain region, primarily in the Wattenberg Field of the Denver-Julesburg Basin of Colorado. As of December 31,2021, it had proved reserves 397.7 MMBoe comprising 143.6 MMbbls of crude oil, 106.0 MMbbls of natural gas liquids, and 888.5 Bcf of natural gas. The company was formerly known as Bonanza Creek Energy, Inc. Civitas Resources, Inc. was founded in 1999 and is based in Denver, Colorado.","Alpha Services and Holdings S.A., together with its subsidiaries, provides various banking and financial products and services to individuals, professionals, and companies in Greece and internationally. It operates through Retail Banking, Corporate Banking, Asset Management and Insurance, Investment Banking and Treasury, South Eastern Europe, and Other segments. The company offers various deposit products, including deposits/savings accounts, working capital/current accounts, checking accounts, investment facilities/term deposits, repos, and swaps; loans comprising mortgage loans, consumer loans, working capital facilities, corporate loans, and letters of guarantee; and debit and credit cards. It also provides leasing and factoring services; asset management services; insurance products; stock exchange, advisory, and brokerage services relating to capital markets; investment banking facilities, as well as deals in interbank market activities and securitization transactions; and mobile and Web banking services. Further, the company provides in the real estate management and hotel services. As of December 31, 2021, it operated 450 branches. The company was founded in 1879 and is based in Athens, Greece.","Nekkar ASA operates in shipyard, aquaculture, renewables, and digital solutions. The company offers shipyard solutions, including Syncrolift shiplift and transfer systems for launching and retrievals of vessels, as well as fast and reliable way of moving vessels around the yard; and FastDocking products for efficient operations during docking and maintenance of vessels. It also offers service and upgrades, shiplift and transfer systems maintenance, spare replacements, and upgrades of small and larger components. In addition, the company offers starfish, an automated and closed cage solution that has double protection against escapes, avoids problems with salmon lice due to water intake from deep waters below the cage, and can collect up to 90 percent of biological waste; and SkyWalker, a wind turbine installation tool. Further, it develops open software platforms for collection, monitoring, and control of data for numerous industries. The company operates in South Asia, Europe, South East Asia, North East Asia, West Asia, the United States, Africa, and internationally. The company was formerly known as TTS Group ASA and changed its name to Nekkar ASA in July 2019. Nekkar ASA founded in 1966 and is headquartered in Kristiansand, Norway.","Inari Amertron Berhad, an investment holding company, engages in the provision of electronic manufacturing, outsourced semiconductor assembly, and testing services for radio frequency, fiber-optics transceivers, optoelectronics, sensors, and custom integrated circuit (IC) technologies in Malaysia, Singapore, the United States, China, the Philippines, and internationally. The company offers wafer processing services covering bumping, probing, laser marking, die sawing, back grinding, flip-chip dice tape and reel, and automated visual inspection; and chip fabrication and wafer certification in fiber optic chips, such as wafer scribe and cleave, bar aligning, demount-load fixtures and facet coating, and chip on carrier. It also provides advanced system in package assembly and test services, including fine-pitch surface mount technology, high speed and high accuracy flip-chip dice placement, in-line post vision, molding underfill, and post-mold oxide plating and final testing, as well as finial testing of advanced communication chips; and other services, such as new product introduction services, failure analysis lab, sensor and IC package design and characterization, process customization and assembly, product testing, box build, and direct-to-end-customer dropship services. In addition, the company manufactures electronics optical fiber and optoelectronics devices, communication chips, and die preparations, as well as offers manufactures, assembles, and tests optoelectronic and sensor components, modules, and systems; designs, develops, and manufactures fiber optic products; designs, assembles, and supplies semiconductor manufacturing process tools, as well as customized semiconductor process tools and parts; and invests in properties. Inari Amertron Berhad was founded in 2006 and is based in Petaling Jaya, Malaysia.","Computershare Limited provides issuer, employee share plans and voucher, business, communication and utilities, technology, and mortgage and property rental services. The company offers issuer services that include register maintenance, corporate actions, stakeholder relationship management, corporate governance, and related services; mortgage services and property rental, including tenancy bond protection services; and employee share plans and voucher services comprising administration and related services for employee share and option plans, and childcare voucher administration services. It also provides business services, including the provision of bankruptcy, class action, and corporate trust administration services; communication services and utilities operations consisting of document composition and printing, intelligent mailing, inbound process automation, scanning, and electronic delivery; and technology services, such as software solutions in share registry and financial services, as well as agency services in connection with the administration of debt securities. It operates in Australia, New Zealand, Asia, Canada, Continental Europe, the United Kingdom, the Channel Islands, Ireland, Africa, and the United States. The company was incorporated in 1978 and is based in Abbotsford, Australia.","Chevron Corporation, through its subsidiaries, engages in integrated energy and chemicals operations worldwide. The company operates in two segments, Upstream and Downstream. The Upstream segment is involved in the exploration, development, production, and transportation of crude oil and natural gas; processing, liquefaction, transportation, and regasification associated with liquefied natural gas; transportation of crude oil through pipelines; and transportation, storage, and marketing of natural gas, as well as operates a gas-to-liquids plant. The Downstream segment engages in refining crude oil into petroleum products; marketing crude oil, refined products, and lubricants; manufacturing and marketing of renewable fuels; transporting crude oil and refined products by pipeline, marine vessel, motor equipment, and rail car; and manufacturing and marketing of commodity petrochemicals, plastics for industrial uses, and fuel and lubricant additives. It is also involved in the cash management and debt financing activities; insurance operations; real estate activities; and technology businesses. The company was formerly known as ChevronTexaco Corporation and changed its name to Chevron Corporation in 2005. Chevron Corporation was founded in 1879 and is based in San Ramon, California.","Voss Veksel- og Landmandsbank ASA provides banking products and services to private individuals and companies in Norway. The company offers saving accounts; car and other vehicle, home, small, and construction loans; overdrafts facilities; leasing services; bank guarantees; bank and payment cards; insurance products; and online and mobile banking services. The company was founded in 1843 and is based in Voss, Norway.","Multiconsult ASA provides engineering design, consultancy, and architecture services in the Norway and internationally. It offers multidisciplinary consultancy, design, planning, project supervision and management, geotechnical site survey, verification and control, analysis and due diligence, environmental and HSE, hydrometry and hydrological field work, river basin management, green bond, and lenders advisory services. The company serves building and properties, cities and society, industry, oil and gas, renewable energy, rail and other transportation, and water and environment sectors. Multiconsult ASA was founded in 1908 and is headquartered in Oslo, Norway.","MONETA Money Bank, a.s., together with its subsidiaries, provides banking and financial products and services to retail customers, small and medium-sized enterprises, corporate clients, and financial and public sector institutions in the Czech Republic. The company operates through Commercial Clients, Retail Clients, and Treasury/Other segments. It offers various deposit products, including current and savings accounts, term deposits, and transactional banking products. The company also provides secured lending products, such as mortgages and finance leases; unsecured lending products comprising consumer and auto loans, credit cards, personal overdrafts, building savings loans, and bridging loans; and commercial lending products that consist of working capital, investment loans, finance and operating leases, auto loans, inventory financing, financing of small businesses and entrepreneurs through guarantees, letters of credits, and foreign exchange transactions. In addition, it intermediates additional payment protection insurance, which covers the customer's monthly loan payment in the event of unemployment, accident, or sickness; and acts as the intermediary to provide its customers with other insurance and investment products. Further, the company engages in the foreign exchange transactions, interest rate swaps, investment in debt securities, equity investments, other non\u0096interest bearing assets, and other operations, as well as provision of debit and credit cards. As of December 31, 2021, it operated a network of 154 branches and 560 ATMs. The company was formerly known as GE Money Bank, a.s. and changed its name to MONETA Money Bank, a.s. in May 2016. MONETA Money Bank, a.s. was incorporated in 1998 and is headquartered in Prague, the Czech Republic.","Blackstone Inc. is an alternative asset management firm specializing in real estate, private equity, hedge fund solutions, credit, secondary funds of funds, public debt and equity and multi-asset class strategies. The firm typically invests in early-stage companies. It also provide capital markets services. The real estate segment specializes in opportunistic, core+ investments as well as debt investment opportunities collateralized by commercial real estate, and stabilized income-oriented commercial real estate across North America, Europe and Asia. The firm's corporate private equity business pursues transactions throughout the world across a variety of transaction types, including large buyouts,special situations, distressed mortgage loans, mid-cap buyouts, buy and build platforms, which involves multiple acquisitions behind a single management team and platform, and growth equity/development projects involving significant majority stakes in portfolio companies and minority investments in operating companies, shipping, real estate, corporate or consumer loans, and alternative energy greenfield development projects in energy and power, property, dislocated markets, shipping opportunities, financial institution breakups, re-insurance, and improving freight mobility, financial services, healthcare, life sciences, infrastructure, enterprise tech and consumer, as well as consumer technologies. The firm considers investment in Asia and Latin America. It has a three year investment period. Its hedge fund business manages a broad range of commingled and customized fund solutions and its credit business focuses on loans, and securities of non-investment grade companies spread across the capital structure including senior debt, subordinated debt, preferred stock and common equity. Blackstone Inc. was founded in 1985 and is headquartered in New York, New York with additional offices across Asia, Europe and North America.","Transmissora Alian\u00e7a de Energia El\u00e9trica S.A. implements, operates, and maintains electric power transmission assets in Brazil. It operates 14,014 kilometers (km) of transmission lines, which include 11,685 km of transmission lines in operation and 2,329 km of lines under construction; and 100 substations with voltage ranging from 230 to 525kV. The company was founded in 2000 is headquartered in Rio de Janeiro, Brazil.","Orange County Bancorp, Inc., through its subsidiaries, provides commercial and consumer banking products and services, and trust and wealth management services to small businesses, middle-market enterprises, local municipal governments, and affluent individuals. It accepts various deposit products, including interest-bearing and noninterest-bearing demand accounts, money market deposit accounts, savings accounts, and certificates of deposit. The company also offers commercial real estate loans, commercial and industrial loans, commercial real estate construction loans, residential real estate loans, home equity loans, and consumer loans. In addition, it provides traditional trust and administration, asset management, financial planning, and wealth management services. The company operates 14 full-service branches and one loan production office in Orange, Westchester, Rockland, and Bronx counties in New York. Orange County Bancorp, Inc. was founded in 1892 and is headquartered in Middletown, New York.","Hill &amp; Smith Holdings PLC manufactures and supplies infrastructure products in the United Kingdom, rest of Europe, North America, the Middle East, rest of Asia, and internationally. It operates through Roads &amp; Security; Utilities; and Galvanizing Services segments. The Roads &amp; Security segment designs, manufactures, and installs temporary and permanent safety products for the roads market, as well as provides range of security products to protect people, buildings, and infrastructure from attacks, including hostile vehicle mitigation solutions, high security fencing, and automated gate solutions. This segment also offers permanent road safety barriers, renewable energy lighting and power solutions, temporary work zone protection products, perimeter security, pedestrian protection products, intelligent traffic solutions, street lighting columns, and car park and bridge parapets. The Utilities segment supplies engineered steel and composite solutions for a range of infrastructure markets, including energy generation and distribution, marine, rail, and housing sectors; and supplies engineered pipe supports for the water, power, and liquid natural gas markets, as well as offers seismic protection solutions. This segment also produces steel products for construction industries, such as residential construction and data centers. The Galvanizing Services segment provides corrosion protection services in the form of hot-dip zinc galvanizing and other coatings for steel products, which includes steel works, lighting columns, bridges, agricultural equipment, and other products for the industrial and infrastructure markets. Hill &amp; Smith Holdings PLC was founded in 1824 and is headquartered in Solihull, the United Kingdom.","Questerre Energy Corporation acquires, explores, and develops non-conventional oil and gas projects in Canada. It produces tight oil, oil shale, shale oil, and shale gas. The company primarily holds 40,800 acres located in Kakwa, west central Alberta, including a 25% working interest in 10,080 acres in Kakwa Central; 50% working interest in 4,480 acres in Kakwa North; 50% interest in 22,400 acres in Kakwa West; and 50% interest in 3,840 acres in Kakwa South. It also holds 100% working interest in 11,952 acres located in Antler, Saskatchewan; and oil shale assets in Jordan. The company was formerly known as Westpro Equipment Ltd. and changed its name to Questerre Energy Corporation in December 2000. Questerre Energy Corporation was incorporated in 1971 and is headquartered in Calgary, Canada.","Hulic Co., Ltd. engages in the development, rental, sale, and brokerage of real estate properties in Japan. The company operates through three segments: Real Estate, Insurance, and Hotels and Inns. Its property portfolio includes office buildings, commercial buildings, residential rental buildings, hotels, and other properties. As of December 31, 2021, the company had a portfolio of approximately 265 lease properties. It also engages in the asset management and insurance agency businesses; and management of hotels and inns. Hulic Co., Ltd. was founded in 1931 and is headquartered in Tokyo, Japan.","PR TIMES, Inc. operates PR TIMES platform that connects companies, media, and consumer with news in Japan. It also offers Jooto, a task and project management tool; Tayori, a cloud information organization tool; Web clipping services that can extract and analyze articles containing specified keywords from domestic news media; PR TIMES LIVE, which offers online coverage of press events; PR TIMES TV, a video PR service; and PR calendar for covering anniversary and seasonal events of companies. The company operates media, such as BRIDGE, isuta, U-NOTE, Techable, STRAIGHT PRESS, IGNITE, PR EDGE, and PR TIMES magazine to deliver information of actors. Further, it offers PR strategy/planning to material creation, and media and SNS relations. The company was incorporated in 2005 and is based in Tokyo, Japan.","Sealed Air Corporation provides food safety and security, and product protection solutions and equipment in North America, South America, Europe, the Middle East, Africa, and the Asia Pacific. It operates through two segments, Food and Protective. The Food segment offers integrated packaging materials and automation equipment solutions to provide food safety and shelf life extension, reduce food waste, automate processes, and optimize total cost for food processors in the fresh red meat, smoked and processed meats, poultry, seafood, plant-based, and dairy markets under the CRYOVAC, CRYOVAC Grip &amp; Tear, CRYOVAC Darfresh, Simple Steps, and Optidure brands. This segment sells its solutions directly to customers through its sales, marketing, and customer service personnel. The Protective segment provides foam, inflatable, suspension and retention, temperature assurance packaging solutions to protect goods to e-commerce, consumer goods, pharmaceutical and medical devices, and industrial manufacturing markets under the SEALED AIR, BUBBLE WRAP, AUTOBAG, SEALED AIR, AUTOBAG, Instapak, Korrvu, Kevothermal, and TempGuard brands. This segment sells its solutions through supply distributors, as well as directly to fabricators, original equipment manufacturers, contract manufacturers, logistics partners, and e-commerce/fulfillment operations. Sealed Air Corporation was incorporated in 1960 and is headquartered in Charlotte, North Carolina.","Holmen AB (publ) produces and sells paperboards, papers, wood products, and renewable energy in Sweden, Germany, the United Kingdom, France, Italy, rest of Europe, Asia, and internationally. The company's Forest segment offers logs, pulpwood, and biofuel to sawmills, pulp mills, and paperboard and paper mills; and manages forests, which cover approximately one million hectares. Its Paperboard segment provides paperboards for consumer packaging to brand owners, converters, and wholesalers. The company's Paper segment offers papers for books, magazines, printed advertising, and packaging to publishers, printing firms, and retailers. Its Wood Products segment provides construction and joinery timber, CLT and glulam products, and wood for pallets and packaging to construction, joinery, and packaging industries, as well as builders' merchants; and operates sawmills. The company's Renewable Energy segment operates 21 hydro power stations; and wind farms with a capacity of approximately 1.2 TWh of electricity. Holmen AB (publ) was founded in 1609 and is headquartered in Stockholm, Sweden.","Interlink Telecom Public Company Limited provides telecommunication services through fiber optic network in Thailand. The company offers various services, such as interlink dark fiber, interlink wavelength, interlink international private leased circuits, and interlink multi-protocol label switching based Internet protocol virtual private network services, as well as telecommunication network installation services. It also provides data center space services, including co-location, virtual server rentalsand disaster recovery services. The company was founded in 2007 and is headquartered in Bangkok, Thailand. Interlink Telecom Public Company Limited is a subsidiary of Interlink Communication Public Company Limited.","Adastria Co., Ltd. plans, produces, and retails clothes and sundry goods in Japan. It offers women's, men's, and children's apparel; and lifestyle items, including bags, shoes, kitchen goods and furniture, and household goods under various brands. The company was formerly known as Adastria Holdings Co., Ltd. and changed its name to Adastria Co., Ltd. in September 2013. Adastria Co., Ltd. was incorporated in 1953 and is headquartered in Tokyo, Japan.","Chubu Electric Power Company, Incorporated, together with its subsidiaries, engages in the generation, transmission, distribution, and retail of electricity in Japan and internationally. The company operates through three segments: JERA, Power Network, and Customer Service &amp; Sales. It generates electricity through thermal, nuclear, hydroelectric, wind, biomass, and solar sources. The company is also involved in the fuel upstream, power generation procurement, and wholesale of electricity and gas businesses; and provides power network services. In addition, it engages in the construction for the development and maintenance of electric utilities-related facilities; and manufacture of materials and machinery for electric utilities-related facilities. Further, the company is involved in the gas supply, on-site energy, consulting and investment, real estate management, IT businesses, etc. Chubu Electric Power Company, Incorporated was founded in 1951 and is headquartered in Nagoya, Japan.","BHG Group AB (publ) operates as a consumer e-commerce company in Sweden, Finland, Denmark, Norway, rest of Europe, and internationally. It operates in two segments, Do-It-Yourself (DIY) and Home Furnishing. The company offers a range of brands totalling approximately 1.5 million products within DIY, leisure, furniture, and furnishings. It operates approximately 100 online sites comprising bygghemma.se, trademax.se, chilli.se, nordicnest.se, and furniturebox.se, as well as approximately 70 showrooms. The company was formerly known as Bygghemma Group First AB (publ) and changed its name to BHG Group AB (publ) in May 2020. BHG Group AB (publ) was founded in 2006 and is headquartered in Malm\u00f6, Sweden.","Engie Brasil Energia S.A., together with its subsidiaries, generates, sells, and trades in electrical energy in Brazil. The company operates 68 plants, including 11 hydroelectric power plants; 4 thermal power plants; 49 wind-powered plants; 3 biomass; 2 photovoltaic solar power plant; 1 conventional thermoelectric plant; and 2 small hydroelectric plants in the 21 states of Brazil. As of December 31, 2021, it had an installed capacity of 8,218.7 megawatts. The company also transports natural gas through 4,500 km of gas pipelines in the Southeast, Northeast, and North regions of Brazil. In addition, it engages in manufacture, wholesale, retail sale, operation, and maintenance of solar panels. The company was formerly known as Tractebel Energia S.A. and changed its name to Engie Brasil Energia S.A. in July 2016. The company was incorporated in 2005 and is headquartered in Florian\u00f3polis, Brazil. Engie Brasil Energia S.A. operates as a subsidiary of ENGIE Brasil Participa\u00e7\u00f5es Ltda.","Space Co.,Ltd. engages in the planning, design, supervision, and construction of commercial facilities in Japan. The company's commercial facilities include shopping centers, department stores, specialty stores, restaurants, and cafes. It is also involved in the planning, design, supervision, and construction of museums and other cultural, sports, and entertainment facilities; and planning, design, production, sale, and import and export of display equipment and fixtures, indoor and outdoor decorative items, furniture, etc. The company plans, designs, supervises, and executes construction and interior finishing works; and plans, designs, supervises, and constructs projects related to shows and exhibitions. Further, it is involved in the planning, design, and production related to public relations and advertising; research, consultation, and publishing related to various items; provision of information; and real estate dealings, leasing, and brokerage activities. The company was founded in 1948 and is headquartered in Tokyo, Japan.","Principal Financial Group, Inc. provides retirement, asset management, and insurance products and services to businesses, individuals, and institutional clients worldwide. The company operates through Retirement and Income Solutions, Principal Global Investors, Principal International, and U.S. Insurance Solutions segments. The Retirement and Income Solutions segment provides a portfolio of asset accumulation products and services for retirement savings and income. It offers products and services for defined contribution plans, including 401(k) and 403(b) plans, defined benefit pension plans, nonqualified executive benefit plans, employee stock ownership plans, equity compensation, and pension risk transfer services; individual retirement accounts; investment only products; and mutual funds, individual variable annuities, and bank products. The Principal Global Investors segment provides equity, fixed income, real estate, and other alternative investments, as well as asset allocation, stable value management, and other structured investment strategies. The Principal International segment offers pension accumulation products and services, mutual funds, asset management, income annuities, and life insurance accumulation products, as well as voluntary savings plans in Brazil, Chile, Mexico, China, Hong Kong Special Administrative Region, India, and Southeast Asia. The U.S. Insurance Solutions segment provides specialty benefits, such as group dental and vision insurance, group life insurance, and group and individual disability insurance, as well as administers group dental, disability, and vision benefits; and individual life insurance products comprising universal, variable universal, indexed universal, and term life insurance products in the United States. It also offers insurance solutions for small and medium-sized businesses and their owners, as well as executives. Principal Financial Group, Inc. was founded in 1879 and is based in Des Moines, Iowa.","Quest Diagnostics Incorporated provides diagnostic testing, information, and services in the United States and internationally. The company develops and delivers diagnostic information services, such as routine testing, non-routine and advanced clinical testing, anatomic pathology testing, and other diagnostic information services. It offers diagnostic information services primarily under the Quest Diagnostics brand, as well as under the AmeriPath, Dermpath Diagnostics, ExamOne, and Quanum brands to patients, clinicians, hospitals, independent delivery networks, health plans, employers, direct contract entities, and accountable care organizations through a network of laboratories, patient service centers, phlebotomists in physician offices, call centers and mobile paramedics, nurses, and other health and wellness professionals. The company also provides risk assessment services for the life insurance industry; and healthcare organizations and clinicians robust information technology solutions. Quest Diagnostics Incorporated was founded in 1967 and is headquartered in Secaucus, New Jersey.","Freund Corporation develops, manufactures, and sells granulation and coating equipment for the pharmaceutical, food, and chemical industries in Japan and internationally. The company offers granulating, coating, drying, printer, tester and analyzer, encapsulation, and dust collector machines, as well as drug formulation machines. It also offers pharmaceutical excipients, food preservatives, machinery for food preservatives, and supplement materials. The company was founded in 1964 and is headquartered in Tokyo, Japan.","Fox Corporation operates as a news, sports, and entertainment company in the United States (U.S.). The company operates through Cable Network Programming; Television; and Other, Corporate and Eliminations segments. The Cable Network Programming segment produces and licenses news, business news, and sports content for distribution through traditional and virtual multi-channel video programming distributors (MVPDs) and other digital platforms, primarily in the U.S. It operates FOX News, a national cable news channel; FOX Business, a business news national cable channel; FS1 and FS2 multi-sport national networks; FOX Sports Racing, a video programming service that comprises motor sports programming; FOX Soccer Plus, a video programming network for live soccer and rugby competitions; FOX Deportes, a Spanish-language sports programming service; and Big Ten Network, a national video programming service. The Television segment acquires, produces, markets, and distributes programming. It operates The FOX Network, a national television broadcast network that broadcasts sports programming and entertainment; Tubi, an advertising-supported video-on-demand service; Fox Alternative Entertainment, a full-service production studio that develops and produces unscripted and alternative programming; MyNetworkTV, a programming distribution service; and Blockchain Creative Labs, which is focuses on the creation, distribution and monetization of Web3 content. This segment owns and operates 29 broadcast television stations. The Other, Corporate and Eliminations segment owns the FOX Studios Lot that provides production and post-production services, including 15 sound stages, two broadcast studios, theaters and screening rooms, editing rooms, and other television and film production facilities in Los Angeles, California. The company was incorporated in 2018 and is based in New York, New York.","CTS Co., Ltd. primarily provides ICT construction services for the construction industry in Japan. The company also offers IT infrastructures systems for construction sites; cloud storage services; mobaden mobile fixed IP phone service; outdoor network construction; network camera; remote work support; multifunction device and cloud scan; and provides AI face recognition and non-contact temperature detector. In addition, it offers 3D and one-man survey, 3D design data, ICT construction, construction management, electronic delivery, and other surveying and measuring equipment, such as lasers; and inspects and repair surveying instruments. Further, the company sells unit houses, office furniture, home appliances, air conditioners, and heating equipment; and rents and sells office desks, meeting tables, chairs, bookshelves, etc., as well as provides sterilization cleaning services. Additionally, it also engages in the lane marking and road sign construction activity; installation of guard fences; and designing and construction of disaster prevention shelters, solar lights, and playground equipment. CTS Co., Ltd. was founded in 1972 and is headquartered in Ueda, Japan.","Tokyo Gas Co., Ltd. engages in the production, supply, and sale of city and liquid gas, and LNG in Japan. The company operates through five segments: Gas, Electric Power, Overseas, Energy Related, and Real Estate. It offers engineering solutions; gas installation work and construction; and gas pipelines services, as well as engages in gas appliances business. The company is also involved in overseas resource development and investment, and energy supply activities. In addition, it engages in the real estate development business; and leasing and management of land and buildings. The company was incorporated in 1885 and is headquartered in Tokyo, Japan.","Webster Financial Corporation operates as the bank holding company for Webster Bank, National Association that provides a range of banking, investment, and financial services to individuals, families, and businesses in the United States. It operates through three segments: Commercial Banking, HSA Bank, and Retail Banking. The Commercial Banking segment provides lending, deposit, and cash management services; commercial and industrial lending and leasing, commercial real estate lending, equipment financing, and asset-based lending, as well as treasury and payment services; wealth management solutions to business owners, operators, and consumers; and trust, asset management, financial planning, insurance, retirement, and investment products. The HSA Bank segment offers health savings accounts, health reimbursement arrangements, flexible spending accounts, and commuter services that are distributed directly to employers and individual consumers, as well as through national and regional insurance carriers, consultants, and financial advisors. The Retail Banking segment provides deposit and fee-based services, residential mortgages, home equity lines, secured and unsecured loans, and credit cards to consumers. The company also offers online and mobile banking services. As of December 31, 2021, it operated 130 banking centers and 251 ATMs. The company was founded in 1935 and is headquartered in Stamford, Connecticut.","Ita\u00fasa S.A., through its subsidiaries, operates in the financial and industrial markets in Brazil and internationally. The company offers credit products and other financial services to individuals and corporate clients. It also manufactures and sells footwear, apparel, and textile items and related components, as well as leather, resin and natural or artificial rubber, and sports articles. In addition, the company engages in the transportation of gas through gas pipelines to distribution companies. Further, it manufactures and sells bathroom porcelain and metals, showers, and electric taps; ceramic tiles, including floor and wall coatings under the Deca, Ceusa, Cecrisa, Hydra, and Portinari brands; and pine and eucalyptus wood panels primarily used in the manufacture of medium, high, and super-density fiberboards, as well as and fiberboards and chipboards under the Durafloor brand. The company was formerly known as Ita\u00fasa - Investimentos Ita\u00fa SA. Ita\u00fasa S.A. was founded in 1966 and is headquartered in S\u00e3o Paulo, Brazil.","Aspen Insurance Holdings Limited, through its subsidiaries, engages in insurance and reinsurance businesses in Australia/Asia, the Caribbean, Canada, the United States, the United Kingdom, Europe, and internationally. Its Aspen Insurance segment offers first party and specialty insurance, including the U.S. and the U.K. commercial property, specie, inland and ocean marine, marine and energy liability, onshore energy physical damage, offshore energy physical damage, credit and political risks, crisis management, accident and health, and surety risks. This segment also provides casualty and liability lines, such as commercial liability, U.S. primary casualty, excess casualty, and environmental and railroad liability; and financial and professional lines comprising financial and corporate risks, professional and management liability, and cyber liability. The company's Aspen Reinsurance segment offers property catastrophe reinsurance products; other property reinsurance products; casualty reinsurance products, including U.S. treaty, international treaty, and casualty facultative reinsurance products; and specialty reinsurance products comprising credit and surety, agriculture, mortgage, marine, aviation, terrorism, engineering, cyber, and other specialty lines. It distributes its products primarily through brokers and reinsurance intermediaries. The company was incorporated in 2002 and is headquartered in Hamilton, Bermuda. Aspen Insurance Holdings Limited is a subsidiary of Highlands Bermuda Holdco, Ltd.","Obara Group Incorporated engages in the manufacture and sale of resistance welder, arc welder, laser equipment, polisher, cleaner/washer, and the consumables in Japan and internationally. The company offers resistance welding systems to weld metal sheets mainly of car bodies; arc welders to weld steel parts by melting welding wires. It also provides polishing equipment for electronic and precision industries, such as polishers for material substrates used for electronic components on PC, mobile phones, etc.; cleaners to clean minute particles off from parts, such as memory disks, flat panel displays, and other opto-electronic parts; laser equipment for the local welding of various metals; and consumable sets, including slurry, abrasives, carriers, pads, and plates for various applications. Obara Group Incorporated was founded in 1955 and is headquartered in Yamato, Japan.","H &amp; M Hennes &amp; Mauritz AB (publ) provides clothing, accessories, footwear, cosmetics, home textiles, and homeware for women, men, teenagers, children, and babies worldwide. It offers sportswear, shoes, bags, beauty products, and ready-to-wear; and interior products, including bed linens, dinnerware, textiles, furniture, and lighting. The company provides its products under the H&amp;M, H&amp;M HOME, COS, &amp; Other Stories, Monki, Weekday, ARKET, Afound, Singular Society, Treadler, Creator Studio, and Sellpy brands. As of November 30, 2021, the company had 54 online markets and approximately 4,801 stores in 75 markets, including franchise markets. H &amp; M Hennes &amp; Mauritz AB (publ) was founded in 1947 and is headquartered in Stockholm, Sweden.","Basler Kantonalbank offers various banking products and services to private and business customers in Switzerland. The company offers personal and savings accounts; mortgages and other loans; debit and credit cards; investment advisory and wealth management services; pension advisory and retirement accounts; financial planning and inheritance advisory services; and digital banking services. It also provides business accounts; business and investment loans, real estate financing, trade financing, and capital goods leasing; consulting services to companies; investment funds; forex trading, precious metal trading, securities trading, and interest rate trading services, as well as corporate finance services; and e-banking and mobile banking services. Basler Kantonalbank was founded in 1899 and is based in Basel, Switzerland.","Red Violet, Inc., a software and services company, specializes in proprietary technologies and applying analytical capabilities to deliver identity intelligence in the United States. It offers idiCORE, an investigative solution used to address various organizational challenges, which include due diligence, risk mitigation, identity authentication, and regulatory compliance; and FOREWARN, an app-based solution that provides instant knowledge before face-to-face engagement with a consumer, as well as helps professionals to identify and mitigate risk. The company serves financial services, insurance, healthcare, retail, and telecommunication companies; law enforcement and government agencies; and collections, corporate security, and investigative firms, as well as solutions used for purposes, such as risk mitigation, due diligence, fraud detection and prevention, regulatory compliance, and customer acquisition. It markets its products and services through value-added distributors, resellers, and strategic partners; and trade shows and seminars, advertising, public relations, distribution of sales literature, and product specifications and ongoing communication with prospective customers, distributors, resellers, strategic partners, and installed base of current customers, as well as through direct sales. Red Violet, Inc. was incorporated in 2017 and is headquartered in Boca Raton, Florida.","Nagaileben Co., Ltd. produces and sells medical clothing in Japan. It offers hospital, clinic, and operation room wear products. The company was founded in 1915 and is headquartered in Tokyo, Japan.","Ship Healthcare Holdings, Inc. engages in the medical, healthcare, welfare, and nursing care businesses worldwide. It operates through four segments: Total Pack Produce Business, Medical Supply Business, Lifecare Business, and Dispensing Pharmacy Business. The Total Pack Produce segment engages in sale of medical devices and medical equipment based on bulk orders; offers consulting services on medicine, healthcare, welfare, and nursing care facilities; and leasing of real estate to medical facilities and other tenants. The Medical Supply segment sells medical examination and treatment materials, and special treatment materials. The Life Care segment operates homes for senior citizens, group homes, and other facilities and nutritional services. The Dispensing Pharmacy segment operates dispensing pharmacies. The company was incorporated in 1992 and is headquartered in Suita, Japan.","transcosmos inc. provides business outsourcing services worldwide. The company offers outsourcing services to back-office operations, including accounting/finance and human resources; order placement services; operation and maintenance of IT systems; and mechanical, architectural, and other design operations. It also provides contract center services, such as outsourcing services for customer support operations comprising dealing with inquires and complaints from consumers, providing products and services information to the customers, and supporting marketing and sales. In addition, the company offers digital marketing services that make use of Internet infrastructures, Internet promotions, Website design and operations, omni cahnnel marketing, and analysis and research services. Further, it provides e-commerce services, including various functions required for e-commerce, such as e-commerce Website development and operation, fulfillment, customer care, online promotions, and analysis services. The company serves financial, telecommunication, high-tech, medical, cosmetics, distribution, automobile, and airline industries, as well as the public sector. transcosmos inc. was founded in 1966 and is based in Tokyo, Japan.","Bufab AB (publ) operates as a trading company that provides solutions for sourcing, quality control, and logistics for C-parts in Sweden and internationally. It offers metal or plastic fasteners comprising screws, bolts, nuts, rivets, pins, washers, etc.; and other small metal, rubber, and plastic parts, including cables, springs, and electronic fasteners. The company also provides stainless steel bolts under the BUMAX brand name; and special products, such as access hardware, cold formed parts, die cast parts, electrical products, machined parts, magnets, plastic parts, rubber parts, stamping and pressing parts, tools and equipment, and turned parts. In addition, it offers assembled parts, add on products, and special packaging and kitting solutions. Further, the company provides supply chain services. It serves customers in a range of manufacturing industries, including the technology, electronics/telecommunications, consumer goods, transportation and construction, furniture, and automotive sectors, as well as the offshore and refining industry. The company was formerly known as Bufab Holding AB (publ) and changed its name to Bufab AB (publ) in June 2015. Bufab AB (publ) was founded in 1977 and is headquartered in V\u00e4rnamo, Sweden.","Webster Financial Corporation operates as the bank holding company for Webster Bank, National Association that provides a range of banking, investment, and financial services to individuals, families, and businesses in the United States. It operates through three segments: Commercial Banking, HSA Bank, and Retail Banking. The Commercial Banking segment provides lending, deposit, and cash management services; commercial and industrial lending and leasing, commercial real estate lending, equipment financing, and asset-based lending, as well as treasury and payment services; wealth management solutions to business owners, operators, and consumers; and trust, asset management, financial planning, insurance, retirement, and investment products. The HSA Bank segment offers health savings accounts, health reimbursement arrangements, flexible spending accounts, and commuter services that are distributed directly to employers and individual consumers, as well as through national and regional insurance carriers, consultants, and financial advisors. The Retail Banking segment provides deposit and fee-based services, residential mortgages, home equity lines, secured and unsecured loans, and credit cards to consumers. The company also offers online and mobile banking services. As of December 31, 2021, it operated 130 banking centers and 251 ATMs. The company was founded in 1935 and is headquartered in Stamford, Connecticut.","ATCO Ltd., together with its subsidiaries, engages in the provision of housing, logistics and transportation, agriculture, water, real estate, and energy and energy infrastructure solutions in Canada, Australia, and internationally. The company offers workforce and residential housing, modular facilities, construction and site support, workforce lodging, facility operations and maintenance, defense operations, and disaster and emergency management services. It also provides commercial real estate services, including sale, lease, and development of commercial and industrial properties; and engages in processing and marketing of fly ash. In addition, it generates electricity through hydro, solar, wind, and natural gas facilities, as well as provides electricity distribution, transmission, storage, and related infrastructure services; offers natural gas transmission, distribution, storage, and retail sales; natural gas liquids storage services; and provides integrated water services, including pipeline transportation, storage, water treatment, recycling, and disposal to various industrial customers. ATCO Ltd. was founded in 1947 and is headquartered in Calgary, Canada. ATCO Ltd. operates as a subsidiary of Sentgraf Enterprises Ltd.","OMER S.p.A. designs, develops, manufactures, and sells components and interior furnishings for railway vehicles in Italy, rest of European Union countries, and internationally. Its products include high speed and regional trains, and subway interiors; upper, side, and lower external fairings and girths for carriages and locomotives; and sanitary modules for trains. The company works in partnership with rolling stock manufacturers engaging in the construction of finished railway vehicles. OMER S.p.A. was founded in 1990 and is headquartered in Carini, Italy.","ASL Marine Holdings Ltd., an investment holding company, provides marine services in the Singapore, Indonesia, Rest of Asia, Europe, Australia, and internationally. The company operates through Shipbuilding; Shiprepair, Conversion, and Engineering; and Shipchartering segments. It constructs vessels, such as offshore support vessels, dredgers, tugs, barges, and tankers; and provides ship repair and conversion services, including retrofitting and conversion, steel renewal, blasting and painting, electrical and electronic works, and mechanical works for the repair and life extension of various types of vessels. The company also owns, operates, and charters a fleet of vessels consisting of tugs, cargo barges, crane barges, split hopper barges, workboats, grab dredgers, landing crafts, tankers, anchor handling tugs, and anchor handling towing/supply vessels for marine contractors in the marine infrastructure and construction, cargoes and equipment transportation, and land reclamation industries; and provides transportation services. In addition, it offers cutting systems, pumping systems, dragheads, dredge line components, and other components, as well as dredge automation products; and market research and public opinion polling services. Further, the company engages in the provision of agency, handling, and consultancy services; and leasing of intellectual property. ASL Marine Holdings Ltd. owns and operates shipyards in Singapore and Indonesia. As of June 30, 2022, it had a fleet of 229 vessels. ASL Marine Holdings Ltd. was founded in 1974 and is based in Singapore.","Triton International Limited engages in the acquisition, leasing, re-leasing, and sale of various types of intermodal containers and chassis to shipping lines, and freight forwarding companies and manufacturers. It operates in two segments, Equipment Leasing and Equipment Trading. The company primarily leases dry, refrigerated, special, and tank containers; and chassis used for the transportation of containers, as well as provides maritime container management services. As of December 31, 2021, its total fleet consisted of 4.3 million containers and chassis representing 7.3 million twenty-foot equivalent units or 8.0 million cost equivalent units. The company also purchases containers from container manufacturers, shipping line customers, and other sellers, as well as resells these containers to container retailers and users. It operates in Asia, Europe, the Americas, Bermuda, and internationally. The company was founded in 1980 and is based in Hamilton, Bermuda.","Sealed Air Corporation provides food safety and security, and product protection solutions and equipment in North America, South America, Europe, the Middle East, Africa, and the Asia Pacific. It operates through two segments, Food and Protective. The Food segment offers integrated packaging materials and automation equipment solutions to provide food safety and shelf life extension, reduce food waste, automate processes, and optimize total cost for food processors in the fresh red meat, smoked and processed meats, poultry, seafood, plant-based, and dairy markets under the CRYOVAC, CRYOVAC Grip &amp; Tear, CRYOVAC Darfresh, Simple Steps, and Optidure brands. This segment sells its solutions directly to customers through its sales, marketing, and customer service personnel. The Protective segment provides foam, inflatable, suspension and retention, temperature assurance packaging solutions to protect goods to e-commerce, consumer goods, pharmaceutical and medical devices, and industrial manufacturing markets under the SEALED AIR, BUBBLE WRAP, AUTOBAG, SEALED AIR, AUTOBAG, Instapak, Korrvu, Kevothermal, and TempGuard brands. This segment sells its solutions through supply distributors, as well as directly to fabricators, original equipment manufacturers, contract manufacturers, logistics partners, and e-commerce/fulfillment operations. Sealed Air Corporation was incorporated in 1960 and is headquartered in Charlotte, North Carolina.","Acomo N.V., together with its subsidiaries, engages in sourcing, trading, processing, packaging, and distributing conventional and organic food products and ingredients for the food and beverage industry worldwide. The company operates through five segments: Spices and Nuts, Edible Seeds, Organic Ingredients, Tea, and Food Ingredients. The Spices and Nuts segment provides tropical products, including pepper, nutmeg, desiccated coconut, shelled and unshelled nuts, dried fruits, dehydrated vegetables, herbs, chocolate, rice crackers, and snack products. The Edible Seeds segment offers in-shell and kernel sunflower, poppy, sesame, and other edible seeds. The Organic Ingredients segment provides a range of organic food products and ingredients in various categories, such as cocoa, coffee, fruit and vegetables, edible seeds, nuts and dried fruits, oils, and premium juice. The Tea segment sources and supplies tea products. The Food Ingredients segment produces and supplies culinary and functional ingredients, wet and dry blends, and spice mixes for food companies. The company was formerly known as Amsterdam Commodities N.V. and changed its name to Acomo N.V. in June 2022. Acomo N.V. was founded in 1819 and is based in Rotterdam, the Netherlands.","Atara Biotherapeutics, Inc., an off-the-shelf T-cell immunotherapy company, develops treatments for patients with cancer, autoimmune, and viral diseases in the United States. It is developing tabelecleucel, a T-cell immunotherapy that is Phase 3 clinical trials for the treatment of epstein-barr virus (EBV) driven post-transplant lymphoproliferative disease, as well as hematologic and solid tumors, including nasopharyngeal carcinoma. The company is also developing next-generation CAR T immunotherapies for patients with hematologic malignancies and solid tumors, including ATA2271 and ATA3271 for mesothelin; and ATA2431 and ATA3219 for B-cell malignancies, as well as ATA188 for the treatment of multiple sclerosis. In addition, it develops ATA368 program for patients with human papillomavirus associated cancers. Atara Biotherapeutics, Inc. has a license agreement with Memorial Sloan Kettering Cancer Center; license, and research and development collaboration agreement with QIMR Berghofer Medical Research Institute; and strategic collaboration with H. Lee Moffitt Cancer Center, as well as Bayer AG for mesothelin-targeted CAR T-cell therapies for solid tumors. The company was incorporated in 2012 and is headquartered in South San Francisco, California.","PPG Industries, Inc. manufactures and distributes paints, coatings, and specialty materials worldwide. The company's Performance Coatings segment offers coatings, solvents, adhesives, sealants, sundries, and software for automotive and commercial transport/fleet repair and refurbishing, light industrial coatings, and specialty coatings for signs; and coatings, sealants, transparencies, transparent armor, adhesives, engineered materials, and packaging and chemical management services for commercial, military, regional jet, and general aviation aircraft. It also provides coatings and finishes for the protection of metals and structures, such as metal fabricators, heavy duty maintenance contractors, and manufacturers of ships, bridges, and rail cars; paints, wood stains, adhesives, and purchased sundries for painting and maintenance contractors, and consumers for decoration and maintenance of residential and commercial building structures; and paints, thermoplastics, pavement marking products, and other technologies for pavement marking. The company's Industrial Coatings segment offers coatings, adhesives and sealants, and metal pretreatments, as well as services and coatings applications for appliances, agricultural and construction equipment, consumer electronics, automotive parts and accessories, building products, kitchenware, and transportation vehicles and other finished products; and on-site coatings services. It also provides coatings for metal cans, closures, plastic tubes, and promotional and specialty packaging; amorphous precipitated silica for tire, battery separator, and other end-uses; TESLIN substrates for labels, e-passports, drivers' licenses, breathable membranes, and loyalty and identification cards; and organic light emitting diode materials, displays and lighting lens materials, optical lenses, color-change products, and photochromic dyes. The company was incorporated in 1883 and is headquartered in Pittsburgh, Pennsylvania.","Paycom Software, Inc. provides cloud-based human capital management (HCM) solution delivered as software-as-a-service for small to mid-sized companies in the United States. It offers functionality and data analytics that businesses need to manage the employment life cycle from recruitment to retirement. The company's HCM solution provides a suite of applications in the areas of talent acquisition, including applicant tracking, candidate tracker, background checks, on-boarding, e-verify, and tax credit services; and time and labor management, such as time and attendance, scheduling/schedule exchange, time-off requests, labor allocation, labor management reports/push reporting, and geofencing/geotracking, and Microfence, a proprietary Bluetooth. Its HCM solution also offers payroll applications comprising better employee transaction interface, payroll and tax management, Paycom pay, expense management, mileage tracker/fixed and variable rates, garnishment management, and GL concierge applications; and talent management applications that include employee self-service, compensation budgeting, performance management, position management, and Paycom learning and content subscriptions, as well as my analytics, which offer employment predictor reporting. In addition, its HCM solution provides manager on-the-go that gives supervisors and managers the ability to perform a variety of tasks, such as approving time-off requests and expense reimbursements; direct data exchange; ask here, a tool for direct line of communication to ask work-related questions; document and checklist; government and compliance; benefits administration/benefits to carrier; COBRA administration; personnel action and performance discussion forms; surveys; and affordable care act applications, as well as Clue, which securely collect, track, and manage the vaccination and testing data of the workforce. Paycom Software, Inc. was founded in 1998 and is headquartered in Oklahoma City, Oklahoma.","Regency Centers is the preeminent national owner, operator, and developer of shopping centers located in affluent and densely populated trade areas. Our portfolio includes thriving properties merchandised with highly productive grocers, restaurants, service providers, and best-in-class retailers that connect to their neighborhoods, communities, and customers. Operating as a fully integrated real estate company, Regency Centers is a qualified real estate investment trust (REIT) that is self-administered, self-managed, and an S&amp;P 500 Index member.","Formycon AG develops and markets biosimilar products. Its product pipeline includes FYB201, a biosimilar candidate for Lucentis, an ophthalmic drug used in the treatment of neovascular age-related macular degeneration and other serious eye diseases; FYB202, a biosimilar candidate for Stelara, a biopharmaceutical used in the treatment of inflammatory diseases, such as moderate to severe psoriasis, as well as for the treatment of Crohn's disease and ulcerative colitis, which is in the Phase III clinical trial; and FYB203, a biosimilar candidate for Eylea to treat neovascular age-related macular degeneration and other eye diseases that is in Phase III clinical trials. The company is also developing FYB206; and FYB207, an antiviral drug for the treatment of COVID-19. It has a collaboration agreement with Leukocare AG to develop stable formulations for various candidates in its product pipeline. The company was formerly known as Nanohale AG and changed its name to Formycon AG in 2012. Formycon AG was founded in 1999 and is headquartered in Planegg, Germany.","WORLDEX INDUSTRY &amp; TRADING CO., Ltd. is a Korea-based company mainly engaged in the manufacturing and distribution of silicon parts used in semiconductor surface etching process. The Company's product portfolio consists of silicon parts, including silicon electrodes, silicon rings, silicon boats, silicon solar batteries and others, quartzes as well as alumina products used for semiconductor, liquid crystal display (LCD) and liquid emitting diode (LED) parts. The Company distributes its products within domestic market and to the overseas markets. It is also engaged in the manufacturing and distribution of LED lightings through its subsidiary.","Rexon Industrial Corp.,Ltd designs, manufactures, and sells bench top/stationary machinery, and consumer and commercial grade fitness products in Taiwan, the United States, Europe, the rest of Asia, and internationally. The company offers power tools, including sawing, drilling, demolishing, grinding, polishing/sanding, cutting, and planning/routing. It also provides fitness equipment, such as treadmills, as well as after-sale services. In addition, the company engages in merchandise trading activities; and the manufacture and sale of electric components and woodworking tools. The company was formerly known as KuoHsing Machinery Ltd. and changed its name to Rexon Industrial Corp.,Ltd in 1976. The company was founded in 1972 and is based in Taichung, Taiwan.","Digital Arts Inc. develops and markets internet security software and appliances in Japan, the United States, Europe, and the Asia Pacific. It offers DigitalArts@Cloud that provides web security and email security in the cloud; i-FILTER, a web filtering software for corporations; i-FILTER Browser &amp; Cloud, a web security solution for smart devices that prevents private usage, visualizes web access with logs and reports, and prevents leaks of critical information; i-FILTER for consumers, a parental control software; D-SPA, a proxy appliance product; m-FILTER, an email filtering software for corporations; and FinalCode, a persistent password-less file security and tracking solution. The company also provides consulting services related to information security solutions; and support services, software version updates, and web filtering databases. Digital Arts Inc. was founded in 1995 and is headquartered in Tokyo, Japan.","PAL GROUP Holdings CO., LTD. engages in the apparel, and miscellaneous goods and accessories businesses primarily in Japan. The company engages in the manufacture, wholesale, and retail of apparel products, including men's and women's clothing and accessories. It also offers miscellaneous daily goods. As of February 28, 2022, the company operated through a network of 902 stores. The company was formerly known as Pal Co., Ltd. and changed its name to PAL GROUP Holdings CO., LTD. in September 2016. PAL GROUP Holdings CO., LTD. was incorporated in 1973 and is headquartered in Osaka, Japan.","The Investment Corporation was listed on the Tokyo Stock Exchange real estate investment trust market on February 7, 2014 with the support of all stakeholders, including unitholders, and gradually expanded its asset size. I've come. The Investment Corporation is investing heavily in \u0093Tokyo Commercial Property,\u0094 whose sponsor Hulic Co., Ltd. has a wealth of investment track record and know-how, and is expected to generate stable demand in the future and secure stable earnings over the long term. , By investing in \u0093next-generation asset plus,\u0094 which the Investment Corporation considers to contribute to maximizing the unitholder value in the medium to long term, secure and improve profits in the medium to long term and increase the size and value of assets under management. We aim to achieve growth. We will continue to utilize the sponsor support provided by the Hulic Group for both external and internal growth with the aim of contributing to the interests of our stakeholders, including investors, and to maximize the maximum value of unitholder value over the medium to long term. We are aiming to achieve this. We would like to ask all of you for your continued support.","Niko Semiconductor Co., Ltd. engages in the research, design, development, and sale of analog IC products in Taiwan, China, and internationally. It offers Power MOSFET, linear regulator, switching regulator and control ICs, low Vf diodes, SiC diodes, and power ICs. The company also develops, manufactures, and sells metal oxide semiconductors; provides product quality monitoring and testing services; and sells self-produced products. Its products are used in main-boards, VGA cards, LCD TVs and monitors, power adapters, laptop computers, telecom and network equipment, etc. The company was formerly known as Super Gem and changed its name to Niko Semiconductor Co., Ltd. in April 2001. Niko Semiconductor Co., Ltd. was incorporated in 1998 and is headquartered in New Taipei City, Taiwan.","AZoom co., Ltd. engages in buying and selling, mediation, management, and leasing of real estate. It is also involved in business development through Internet; Internet media development and operation; and management of parking lots. The company was founded in 2009 and is based in Tokyo, Japan.","Koei Tecmo Holdings Co., Ltd., together with its subsidiaries, operates as an entertainment company in Japan, North America, Europe, rest of Asia, and internationally. The company operates through Entertainment, Amusement, and Real Estate segments. The Entertainment segment develops and sells entertainment contents. It offers software for personal computers and gaming consoles. The Amusement segment develops commercial amusements; and manages amusement arcades. The Real Estate segment engages in the operation, management, and lease of real estate properties. It is also involved in the venture capital and other activities. The company was founded in 2009 and is headquartered in Yokohama, Japan. Koei Tecmo Holdings Co., Ltd. is a subsidiary of Koyu Holdings Co., Ltd.","PCI Holdings, Inc. engages in the information service business. It develops embedded control software for automobiles, heavy machinery, construction machinery, etc.; and equipment for telecommunications field, including mobile communication, as well as other information home appliances, various industrial equipment, semiconductor manufacturing equipment, etc. The company also develops software, middleware, and application that control various devices; firmware, such as shooting control for digital cameras; and software for control semiconductor inspection equipment. In addition, it develops information software for finance, manufacturing, distribution, and other companies; and social infrastructure software for transportation and broadcasting, and IT systems. Further, the company constructs and sells solutions utilizing packaged software products; operates and maintains system; and purchases and sells other hardware, etc. Additionally, it develops Internet of Things/Internet of everything solutions; and remote monitoring systems for the power generation industry, as well as provides operation and maintenance support services for renewable energy generation facilities. The company also offers services for semiconductor development, including LSI design, test design, evaluation, and others. PCI Holdings, Inc. was incorporated in 2005 and is headquartered in Tokyo, Japan.","KEIWA Incorporated manufactures and sells optical sheets and functional products in Japan. The company provides light diffusion sheets used in backlight units of liquid crystal displays of smartphones; components for special optical films, such as protective films of light collecting films, etc.; and advanced functional films and sheets used for display surface protection in the optical systems, as well as other applications. It also offers industrial packaging materials, industrial processing papers, and clean energy materials, as well as other industrial materials, such as construction and agricultural materials. The company was formerly known as KEIWA Commerce and Industry Co., Ltd. and changed its name to KEIWA Incorporated in 1999. KEIWA Incorporated was founded in 1948 and is headquartered in Tokyo, Japan.","Future Corporation provides IT consulting and services primarily in Japan. The company offers its services in digital marketing, IT education, e-commerce, and various other fields. The company was formerly known as Future Architect, Inc. and changed its name to Future Corporation in April 2016. Future Corporation was founded in 1989 and is headquartered in Tokyo, Japan.","Earth Corporation engages in the manufacture, marketing, import, and export of pharmaceutical products, quasi-drug products, medical tools, and household products in Japan and internationally. It operates through Household Products Business and General Environment and Sanitation Business segments. The company offers insecticides and repellents; gardening supplies; household products, such as mouthwash, denture-related supplies, toothpaste and related products, bath salts, deodorizing air fresheners, etc.; pet products; and chemical agents for communicable disease control, agriculture, forestry, and animal husbandry; and raw materials. In addition, it provides hygiene management services. The company markets its products under the various brands, including Earth Red, Earth No-mat, Earth Jet, ZEROdeKNIGHT, Earth Mosquito Coil, Earth Mushi Yoke Net EX, Ari no Su Korori, Goki Push Pro, Gokiburi Hoi-Hoi, Goki Jet Pro, Kobae ga Hoi Hoi, Saratect, Dani Earth, Naturas, Vapona, Mamo room, Black Cap, White Cap, Mushi Konai Earth, Mushi Korori Ground, natuvo, Mondahmin, Bath Roman, Onpo, Onso, Yu Meguri, Pirepara Earth, Ulmore, Sukki-ri!, Earth Garden, Polident, Poligrip, Aquafresh, N.act, Sensodyne, Kamutect, Biotene, Tachiiri Kinshi, Ouchi no Kusa Korori, Oniwa no Mushi Korori, Weed Killer, Mihariban, Aller Block, Helper Tasuke, Raku Hapi, Sebon, and Cleverin. Earth Corporation was founded in 1892 and is headquartered in Tokyo, Japan.","Sanyo Special Steel Co., Ltd., together with its subsidiaries, manufactures and sells special steel products in Japan and internationally. The company operates through Specialty Steel, Metal Powder, Formed and Fabricated Materials, and Others segments. The Specialty Steel segment provides various special steel products, including bearing, engineering, stainless, heat resistant, and tool steel products. The Metal Powder segment manufactures and sells metal powders and powder metallurgy products. The Formed and Fabricated Materials segment offers cut rings, die-forged/rolled, forged rings, and cold-rolled ring products made from special steel bars and tubes. The Other segment provides information processing services. The company also engages in the trading of special steel products, steelmaking raw materials, and other materials; and the provision of security and facilities maintenance services, and machinery maintenance services. Its steel products are used in a range of automobiles, railroads, construction machines, electronics products, and information communication devices. The company was formerly known as Sanyo Steel Works and changed its name to Sanyo Special Steel Co., Ltd. in 1959. The company was founded in 1933 and is headquartered in Himeji, Japan. Sanyo Special Steel Co., Ltd. is a subsidiary of Nippon Steel Corporation.","Zoom Video Communications, Inc. provides unified communications platform in the Americas, the Asia Pacific, Europe, the Middle East, and Africa. The company offers Zoom Meetings that offers HD video, voice, chat, and content sharing through mobile devices, desktops, laptops, telephones, and conference room systems; Zoom Phone, an enterprise cloud phone system; and Zoom Chat enables users to share messages, images, audio files, and content in desktop, laptop, tablet, and mobile devices. It also provides Zoom Rooms, a software-based conference room system; Zoom Hardware-as-a-Service allows users to access video communication technology from third party equipment; Zoom Conference Room Connector, a gateway for SIP/H.323 endpoints to join Zoom meetings; Zoom Events, which enables users to manage and host internal and external virtual events; OnZoom, a prosumer-focused virtual event platform and marketplace for Zoom users to create, host, and monetize online events; and Zoom Webinars to provide video presentations to large audiences from many devices. In addition, the company offers Zoom Developer Platform that enables developers, platform integrators, service providers, and customers to build apps and integrations using Zoom's video-based communications solutions, as well as integrate Zoom's technology into their products and services; Zoom App Marketplace, which helps developers to publish their apps, as well as third-party integrations of Zoom; and Zoom Contact Center, an omnichannel contact center solution. It serves individuals; and education, entertainment/media, enterprise infrastructure, finance, government, healthcare, manufacturing, non-profit/not for profit and social impact, retail/consumer products, and software/Internet industries. The company was formerly known as Zoom Communications, Inc. and changed its name to Zoom Video Communications, Inc. in May 2012. The company was incorporated in 2011 and is headquartered in San Jose, California.","Nachi-Fujikoshi Corp. operates as a machinery manufacturer in Japan, rest of Asia, China, the Americas, and Europe. The company provides cutting tools, including drills, taps, end mills, gear cutters, broaches, and cut-off and re-grinding tools; and machine tools, such as broaching machines, precision roll forming machines, grinding machines, machining cells, and power finishers, as well as skiving machining center for gears. It also offers robots for spot and arc welding, handling, palletizing, heavy duty, cleanroom, and option, as well as controllers and support services; and radial ball, radial roller, thrust ball, and thrust roller bearings, as well as bearing units and plummer block housings. In addition, the company provides hydraulic equipment comprising valves, pumps, motors, units, and rotary center joints; special steels consisting of high speed tool and alloy tool steels, bearing and martensitic stainless steels, cermet, and micron hard products; and industrial furnaces, including vacuum carburizing furnace, and vacuum degreasing machine and system, as well as coating equipment and services. Further, it offers forming tools, cutting saws, machining systems, and automotive hydraulics. Additionally, the company provides engineering services for regrinding and recoating of tools, robots, machining equipment, heat treatment equipment, bearings, hydraulic equipment, and special steels. It serves customers in the automotive, machinery and retail, energy, and infrastructure markets. Nachi-Fujikoshi Corp. was incorporated in 1928 and is headquartered in Tokyo, Japan.","DAIHEN Corporation manufactures and sells power products, welding machines, and industrial and clean transfer robots. The company operates through Power Products Business, Welding &amp; Mechatronics Business, Semiconductor and FPD Related Business, and Other segments. It offers transformers, power distribution equipment, distribution equipment for electric power companies, solar inverters, and others; and welding/cutting machines, such as CO2/MAG, TIG, MIG, DC/AC, plasma welding and cutting, submerged arc, and resistance welding machines, as well as welding and cutting torches, peripheral devices for welding, thermal spray machines, and welding accessories. The company also provides robots, teach pendants, sensors for robot welding, positioners and sliders, PC software, and welding power sources and welding peripherals for robots. In addition, it offers RF/MW generators and automatic matching units for plasma applications; clean transfer robots; and wireless power transfer systems. Further, the company manufactures electronic devices, luminaire stabilizers, calorifiers, switches, housing equipment, distribution and control panels, monitoring and control systems, etc.; control and telecommunications equipment, and RF generators; hot charge; fuses; ballasts for discharge lamps; and material handling equipment for semiconductor and flat panel manufacturing systems. Additionally, it is involved in the installation, repair, inspection, maintenance, and remodeling of welding machines, cutting machines, and industrial robots, as well as transformers and switchgear systems; manufacture, processing, and coating of transformer parts; dispatch of personnel; health, welfare, and pension work for employees; and metal processing and real estate leasing activities. The company was formerly known as Osaka Transformer Co., Ltd. and changed its name to DAIHEN Corporation in December 1985. DAIHEN Corporation was incorporated in 1919 and is headquartered in Osaka, Japan.","Tera Probe, Inc. engages in wafer testing, final testing, and test engineering business in Japan and internationally. The company provides testing and test related services for various semiconductor devices, including DRAM, SoC, CPU, image sensors, and analog devices; and test program cross-platform conversion services for debugging, as well as test patterns conversion services to work with testers. It also offers design and development support services, and mass production for various probe cards; and provides card evaluation and parallelism testing services. The company was founded in 2005 and is headquartered in Yokohama, Japan. Tera Probe, Inc. is a subsidiary of Powertech Technology Inc.","Suzuden Corporation engages in purchasing and selling products related to electrical and electronic components in Japan. It offers FA equipment, including RFID equipment, relay equipment, sensors, control equipment, etc.; information and communication equipment, such as CPUs, personal computers for industrial use, routers, network equipment, etc.; electronics and devices comprising connectors, switching power supplies, noise filters, etc.; and materials for electric
