 facilities, including terminal blocks, cable accessories, boxes, etc. The company was founded in 1948 and is headquartered in Tokyo, Japan. Suzuden Corporation is a subsidiary of Yamato Corporation.","Formosa Advanced Technologies Co., Ltd. provides wafer probe, integrated circuit (IC) assembly and testing, module turnkey, and LED chip services in Taiwan. It provides IC package solutions for portable electronic products, cell phones, memory modules, PC cards, PDAs, disc drives, and telephone handsets; DIMM products for laptops; flash cards; and LED products comprising PLCC, EMC, and UV LED products. The company also offers assembly services; and testing services, including wafer probe, burn in, and final testing services for memory, and logical and mixed-signal semiconductors, as well as testing program verification, tester/hi-fix correlation, engineering lot support, production lot verification, and periodical report. In addition, it provides module services, such as customized products, and OEM and ODM services, as well as blank DRAM modules, including U-DIMM, SO-DIMM, R-DIMM, and FB-DIMM; and LED chip back-end services, such as grinding, dicing, probing, sorting, and PI services. The company was founded in 1990 and is headquartered in Douliou City, Taiwan.","Arealink Co., Ltd. engages in the self-storage business in Japan. It operates, markets, and manages rental storage spaces; and sells self-storage properties. The company offers land rights consolidation services, including resolution of issues between landowners and leasehold rights holders through buying and selling of leasehold land. It also leases or acquires and holds land and buildings for the asset or office building business; and adds value, operates, and manages the properties. The company was incorporated in 1995 and is headquartered in Tokyo, Japan.","Premier Investment Corporation (PIC) is a J-REIT (real estate investment trust) that manages a portfolio comprised of office buildings and residential properties, investing primarily in the Tokyo Economic Bloc. PIC was the sixth J-REIT listed on the Tokyo Stock Exchange (securities code: 8956) in September 2002. Since then, PIC has steadily expanded its portfolio valued at over 200 billion yen on an acquisition price basis. PIC utilizes a hedged strategy that minimizes risk by combining the strengths of office buildings and residential properties against economic cycles, as well as employing a strategic focus on the Tokyo Economic Bloc and prudent management of debt and equity financing. This approach has enabled PIC to successfully achieve steady dividends at a high level over the past fiscal periods. PIC outsources management of its assets to Premier REIT Advisors, Co., Ltd. (PRA). Both PIC and PRA are committed to realizing stable operations over the medium to long term while working to improve the quality of the owned assets.","Seibu Holdings Inc. engages in the urban and regional transportation, hotel and leisure, real estate, construction, and other businesses in Japan. It operates through Urban Transportation and Regional, Hotel and Leisure, Real Estate, Construction, Hawaii Business, and Other Business segments. The company offers railway, bus, and transportation services; operates hotels, golf courses, ski resorts, and leisure facilities; develops Seibu Railway lines and hotel sites in city centers; leases office and residential facilities; and develops and operates stores in train stations, shopping malls, and other commercial facilities. It is also involved in the construction of railway lines, social infrastructure, hotel remodeling, private sector construction, and housing. In addition, the company produces, processes, and sells gravel, sand, and other raw materials used in civil engineering and construction projects; designs and executes landscaping projects; and maintains and operates state-run parks. Further, the company operates express ways and cruise ships; and maintains a professional baseball team. Additionally, the company offers housekeeping, child-rearing support, home, and urban development services; and insurance and pet care products, as well as builds cemeteries. Seibu Holdings Inc. was incorporated in 2006 and is headquartered in Tokyo, Japan.","Nippon Television Holdings, Inc. operates as a media and content company in Japan. The company engages in the production of broadcasting programs; digital broadcasting; technical production related to studios, live broadcasting, master technology, EJ news gathering, editing, postproduction, etc.; and programming, content production, closed captioning, library, etc. It is also involved in sporting and various NTV events; the management of NTV school; art design, and lighting and sound effects; design of sets, flip charts, and TV graphics; production of pamphlets, posters, etc.; intellectual property management; management of music publishing, CD master, and merchandising rights; production CDs and DVDs; rental of recording studios; and operation of fitness clubs, insurance agencies, and museums. In addition, the company engages in the production and construction of exhibitions, sales promotion events, international sports events, theme parks, amusement facilities, national ceremonies, etc.; production of program-related merchandise goods; commercial building maintenance; race track, concerts, and events management; ICT, development of apps for business, web development, video streaming, infrastructure solutions, and advertising; shopping portal sites management; production of animation, TV programs, commercial films, graphic designs, illustrations, characters, social games, and other content; copyright management; and internet content streaming. Further, it engages in the provision of software and systems for VOD and live streaming platforms and players; news gathering, reporting, and production of information, sports programs, etc.; 3D computer graphics; services to program and technology production, clerical, and management duties; e-commerce, esports, and talent production agency businesses; contractual production of programs for broadcasters; and influencers network and production business. The company was incorporated in 1952 and is based in Tokyo, Japan.","RENOVA, Inc. operates in the renewable energy industry in Japan. It operates through Renewable Energy Power Generation Business and Renewable Energy Development and Operation Business segments. The Renewable Energy Power Generation Business segment generates and sells electricity from renewable energy power plants. The Renewable Energy Development and Operation Business segment develops and assists in the operation of renewable energy power plants. The company generates electricity through solar, biomass, wind, geothermal and hydro power plants. RENOVA, Inc. was incorporated in 2000 and is based in Tokyo, Japan.","Asset Five Group Public Company Limited engages in the development and sale of real estate properties in Thailand. It sells land, houses, and units of residential condominium. The Company was founded in 2013 and is based in Bangkok, Thailand.","African Agriculture Holdings Inc., a food security company, engages in operating a commercial-scale alfalfa farm on the African continent. The company is based in New York, New York. African Agriculture Holdings Inc. operates as a subsidiary of Global Commodities &amp; Investments Ltd.","Ambev S.A., through its subsidiaries, produces, distributes, and sells beer, draft beer, carbonated soft drinks, other non-alcoholic beverages, malt, and food products in the Americas. The company operates through four segments: Brazil; Central America and the Caribbean; Latin America South; and Canada. It offers beer primarily under the Skol, Brahma, Antarctica, Brahva, Brahva Gold, Extra, Bud Light, Beck, Leffe and Hoegaarden, Bucanero, Cristal, Mayabe, Cacique, Presidente, Brahma Light, Presidente Light, Presidente Golden Light, Bohemia, The One, Corona, Modelo Especial, Stella Artois, and Budweiser, Quilmes Cl\u00e1sica, Pace\u00f1a, Taqui\u00f1a, Huari, Becker, Cusque\u00f1a, Michelob Ultra, Busch, Pilsen, Ouro Fino, Banks, Deputy, Patricia, Labatt Blue, Alexander Keith's, and Kokanee brands. The company also provides bottled water, isotonic beverages, energy drinks, coconut water, powdered and natural juices, and ready-to-drink teas under the Guaran\u00e1 Antarctica, Gatorade, H2OH!, Lipton Iced Tea, Fusion, Do Bem, Pepsi, Canada Dry, Squirt, Red Rock, Pepsi-Cola, Seven Up, Nutrl, Bud Light Seltzer, Palm Bay, and Mike's brands. It offers its products through a network of third-party distributors and a direct distribution system. The company was founded in 1885 and is headquartered in S\u00e3o Paulo, Brazil. Ambev S.A. is a subsidiary of Interbrew International B.V.","ACM Research, Inc., together with its subsidiaries, develops, manufactures, and sells single-wafer wet cleaning equipment for enhancing the manufacturing process and yield for integrated chips worldwide. It offers space alternated phase shift technology for flat and patterned wafer surfaces, which employs alternating phases of megasonic waves to deliver megasonic energy in a uniform manner on a microscopic level; timely energized bubble oscillation technology for patterned wafer surfaces at advanced process nodes, which provides cleaning for 2D and 3D patterned wafers; Tahoe technology for delivering cleaning performance using less sulfuric acid and hydrogen peroxide; and electro-chemical plating technology for advanced metal plating. The company markets and sells its products under the Ultra C brand name through direct sales force and third-party representatives. ACM Research, Inc. was incorporated in 1998 and is headquartered in Fremont, California.","AAPICO Hitech Public Company Limited engages in the manufacture and distribution of automobile parts, dies, and jigs in Thailand, China, Malaysia, and Portugal. It operates in three segments: Manufacture of Auto Parts; Sales of Automobiles and Provision of Automobiles Repair Service; and Others. The company offers stamped or pressed parts, including chassis frame components, housing axles parts, pressed and stamped body parts, door check link, and brake lines, fuel lines, engine, and brazing parts; forged and machined parts, such as transmission, power train, steering and suspension systems, engine, shafts, wheel hubs, and other parts, as well as connecting rods and copper forged parts; and plastic parts and plastic fuel tanks. It also provides roof ditch mouldings, belt line mouldings, door sash products, brazed steel tubing, door checks and hinges, and parking brake lever products; assembly jigs; and stamping dies. In addition, the company is involved in the sale of automobiles; provision of automobile repair, training, technical support, and information technology consulting and advisory services; venture capital business; investment in other companies; and import and export of vehicles and parts. Further, it manufactures 3D car navigation and digital map solutions under the POWERMAP brand with voice activation software, as well as Oracle ERP systems; and operates car dealership service centers. The company was founded in 1996 and is headquartered in Phra Nakhon Si Ayutthaya, Thailand.","Alkane Resources Limited operates as a gold production company in Australia. It explores for gold, copper, nickel, zinc, and silver deposits. The company holds various interests in the Tomingley Gold project that consists of four gold deposits; and the Northern Molong Porphyry Project, which covers an area of 115 square kilometers located in the Central West of New South Wales. Its exploration projects comprise Boda and Kaiser, Cudal, Peak Hill, Elsienora, Rockley, Armstrongs, Trangie, and Mt Conqueror projects. The company also invests in junior gold mining companies and projects. Alkane Resources Limited was incorporated in 1969 and is headquartered in West Perth, Australia.","Angus Energy plc, an investment holding company, engages in the development, production, and distribution of hydrocarbons to third parties in the United Kingdom. It holds 80% interests in the Brockham oil field covering 8.9 km2 and the Lidsey oil field covering 5.3 km2 located in Weald Basin; 51% interests in the Saltfleetby gas field covering 91.8 km2 located in Lincolnshire; and 25% interest in the Balcombe field covering 154 km2 located in Weald Basin, as well as 12.5% interests in the A24 Prospect. The company was incorporated in 2015 and is based in London, the United Kingdom.","AP (Thailand) Public Company Limited, together with its subsidiaries, engages in the real estate development business in Thailand. It operates through Low\u0096Rise, High\u0096Rise, and Other segments. The Low-rise segment develops single-detached houses and townhouses. The High-rise segment develops condominiums. The Other segment provides after-sales, property brokerage, and construction services. This segment also offers education and training services. The company was formerly known as Asian Property Development Public Company Limited and changed its name to AP (Thailand) Public Company Limited in May 2013. AP (Thailand) Public Company Limited was founded in 1991 and is headquartered in Bangkok, Thailand.","Alpha Astika Akinita S.A., together with its subsidiaries, provides various real estate services in Greece. It offers purchases/sales services, such as locating suitable real estate, evaluation of offers, negotiations, and action co-ordination for completing the purchase or sale; rents/lease services, such as locating leaseholds and lessees, evaluation of offers, rent-lease negotiations, and rent collection; and financial and technical studies, including real estate assessments, studies on exploiting real estate, and market research concerning rents and sales-purchases. The company also provides project management services consisting of the determination of the project's specifications, realization and supervision of studies, selection of the appropriate developers, drafting of contractual terms and conditions, project management during construction, and supervision and coordination of the project. In addition, it offers a range of consultative services for the public and private sector in the field of real estate; and supervision/management of real estate comprising rent collection, monitoring the observance of building regulations, the observance of contractual obligations, and real estate inspection services. The company also provides property management and development services for private owners, as well as offers technical consultant's advice. It provides its services to third-party customers consisting of corporations, private individuals, organizations, insurance funds, etc. Alpha Astika Akinita S.A. was founded in 1942 and is based in Athens, Greece. Alpha Astika Akinita S.A. operates as a subsidiary of Alpha Services and Holdings S.A.","ATMA Participa\u00e7\u00f5es S.A., through its subsidiaries, provides contact center and trade marketing services. It offers industrial maintenance and facilities services; and information technology services. The company was formerly known as Liq Participa\u00e7\u00f5es S.A. and changed its name to ATMA Participa\u00e7\u00f5es S.A. in March 2020. ATMA Participa\u00e7\u00f5es S.A. was founded in 2000 and is based in S\u00e3o Paulo, Brazil.","Baidu, Inc. offers internet search services in China. It operates through Baidu Core and iQIYI segments. The company offers Baidu App to access search, feed, and other services using mobile devices; Baidu Search to access its search and other services; Baidu Feed that provides users with personalized timeline based on their demographics and interests; and Haokan, a short video app. It also provides Baidu Knows, an online community where users can ask questions to other users; Baidu Wiki; Baidu Healthcare Wiki; Baidu Wenku; Baidu Scholar; Baidu Experience; Baidu Post; Baidu Maps, a voice-enabled mobile app that provides travel-related services; Baidu Drive; Baijiahao; and DuerOS, a smart assistant platform. In addition, it offers online marketing services, which include pay for performance, an auction-based services that allow customers to bid for priority placement of paid sponsored links and reach users who search for information related to their products or services; other marketing services that include display-based marketing services and other online marketing services based on performance criteria other than cost per click; mobile ecosystem, a portfolio of apps, including Baidu App, Haokan, and Baidu Post; various cloud services and solutions, such as platform as a service, software as a service, and infrastructure as a service; self-driving services, including maps, automated valet parking, autonomous navigation pilot, electric vehicles, and robotaxi fleets, as well as Xiaodu smart devices. Further, the company provides iQIYI, AN online entertainment service, including original and licensed content; other video content and membership; and online advertising services. Baidu, Inc. has strategic partnership with Zhejiang Geely Holding Group. The company was formerly known as Baidu.com, Inc. Baidu, Inc. was incorporated in 2000 and is headquartered in Beijing, China.","Bangkok Bank Public Company Limited provides various commercial banking products and services in Thailand and internationally. The company operates through Domestic Banking, International Banking, Investment Banking, and Others segments. It offers various personal banking products and services, including savings, current, fixed deposit, foreign currency, and other accounts; home and personal loans, as well as loans for pensioners; mutual funds; investments products and services, such as bonds and debentures, as well as agency services; life and non-life bancassurance products; payment, funds transfer, currency exchange and foreign instrument, and SMS services; debit, credit, and prepaid cards; and phone and Internet banking, mobile banking, ATMs, and other services. The company also provides business banking products and services comprising operating accounts; loans for SMEs, international trade, investment banking, and e-guarantee services; securities services, such as custodian, mutual fund supervisor, provident fund registrar, securities registrar, and debenture holders' representative services; personal loans for small businesses; payment, collection, and merchant services; digital banking services; and commercial cards. In addition, it offers trade finance, remittances, export and import, project, corporate finance, and financial advisory services, as well as liquidity, fund, and asset management services. Bangkok Bank Public Company Limited was founded in 1944 and is headquartered in Bangkok, Thailand.","BCB Bancorp, Inc. operates as a bank holding company for BCB Community Bank that provides banking products and services to businesses and individuals in the United States. The company offers deposit products, including savings and club accounts, interest and non-interest-bearing demand accounts, money market accounts, certificates of deposit, and individual retirement accounts. It also provides loans, such as commercial and multi-family real estate, one-to-four family mortgage, commercial business, small business administration, construction, home equity and lines of credit, and consumer loans, as well as residential loans secured by one-to-four family dwellings, condominiums, and cooperative units. In addition, the company offers retail and commercial banking services comprising wire transfers, money orders, safe deposit boxes, night depository services, debit cards, online and mobile banking services, fraud detection services, and automated teller services. As of December 31, 2021, it operated 29 branch offices in Bayonne, Carteret, Edison, Hoboken, Fairfield, Holmdel, Jersey City, Lyndhurst, Maplewood, Monroe Township, Newark, Parsippany, Plainsboro, River Edge, Rutherford, South Orange, Union, and Woodbridge, New Jersey, as well as three branches in Staten Island and Hicksville, New York. The company was founded in 2000 and is headquartered in Bayonne, New Jersey.","Banque Cantonale Vaudoise provides a range of financial services in Vaud Canton and rest of Switzerland, the European Union, North America, and internationally. The company offers current, savings, and retirement accounts; credit and payment cards; mortgage, personal, home, business, and construction loans; and production equipment financing products, and working capital and international trade finance products. It also provides a range of banking products, such as investments, financial planning services, and trading through its online platform; and cash management services, as well as instruments for hedging exchange-rate and interest-rate risk; asset management services; and investment and hedging products, such as currencies, equities, bonds, derivatives, and structured products. In addition, the company engages in the market transactions in equities, fixed-income instruments, forex, and precious metals on behalf of clients. Further, it provides life and disability insurance products, and online banking services; manages finances and investments of high-net-worth individuals; tax planning, estate planning, and financial planning; and retirement, life insurance, and disability coverages. The company operates through a network of approximately 63 branches and 220 ATMs. It primarily serves retail and business customers, and public sector institutions. The company was founded in 1845 and is headquartered in Lausanne, Switzerland.","Blau Farmac\u00eautica S.A., a pharmaceutical company provides private label drugs in Brazil, Argentina, Colombia, the United States, Ecuador, Peru, and Uruguay. The company's medications cover various therapeutic classes, such as immunology, hematology, oncology, nephrology, specialties, and antibiotics. It also offers biological drugs; oral and injectable drugs for treating cancer; specialized treatments for infectious diseases; and prescription and non-prescription drugs, including dermo-medicines, condoms, and others for retail and non-retail markets. In addition, the company provides blood-derived, biological, biotechnological, and antiretroviral drugs. It serves hospitals, private clinics, chemotherapy and hemodialysis centers, and public health institutions. The company was incorporated in 1987 and is headquartered in Cotia, Brazil.","Byggma ASA manufactures and supplies building materials in Norway, Sweden, Denmark, Finland, the United Kingdom, the Netherlands, and internationally. It offers pre-painted ceilings and wall panels under the Huntonit brand name; I-beams for use in ceilings, walls, and floors in wood-based buildings under the brand name of Masonite; and particle boards, boards, and structural panels for use in buildings, interior ceilings, and wall panels under the Forestia brand name. The company also provides home lighting products under the Scan Lamps brand name; doors and windows for new buildings, extensions, and rehabilitation under the brand name of Uldal; a range of lamp and lighting products under the Aneta brand name; and develops, manufactures, and distributes MDF panels for walls, ceilings, bathrooms, and kitchens under the brand name of Smartpanel, as well as supplies OSB plywood and building boards under the brand name of Byggform. It exports its products. Byggma ASA is headquartered in Vennesla, Norway. Byggma ASA operates as a subsidiary of Investor As.","bpost NV/SA, together with its subsidiaries, provides mail and parcel services to consumers, businesses, and government in Belgium, rest of Europe, the United States, and internationally. The company operates in three segments: Mail &amp; Retail; PaLo N. Am.; and PaLo Eurasia. Its mail and parcels services include collection, transport, sorting, and distribution of addressed and non-addressed mail, printed documents, newspapers, and parcels, as well as banking and financial products, e-commerce logistics, express delivery, proximity and convenience, document management, and related services. The company also offers transactional mails, advertising mails, press, domestic and international parcels, logistic solutions, and cross-border products, as well as value-added services. bpost NV/SA was incorporated in 1830 and is headquartered in Brussels, Belgium.","Cairo Mezz Plc holds and manages contributed bonds. The company was formerly known as Mairanus Ltd. and changed its name to Cairo Mezz Plc in September 2020. The company was founded in 2020 and is based in Nicosia, Cyprus.","Central Depository Services (India) Limited provides depository services in India. The company offers various services, such as account opening, dematerialization, processing delivery and receipt instructions, account statement, re-materialization, pledging, nomination, transmission of securities, change in address, bank account details, and SMS services for depository participants. It also provides facilities to issuers to credit securities to a shareholder's or applicants demat accounts; KYC services in respect of investors in capital markets to capital market intermediaries; facilities for holding of insurance policies in electronic form to the holders of these policies; and facilities for holding and transacting in electronic negotiable warehouse receipts. In addition, it offers services, such as electronic access to security information, electronic access to security information and execution of secured transaction, e-voting, e-notices, e-locker, and mobile application. It serves investors through depository participants, issuer companies, capital market intermediaries, insurance companies, and warehouse service providers/warehouses. The company was incorporated in 1997 and is based in Mumbai, India.","CEZ, a. s., an electricity generation company, engages in the production, distribution, trade, and sale of electricity and heat in Western, Central, and Southeastern Europe. The company operates through four segments: Generation, Distribution, Sales, and Mining. It operates two nuclear plants, sixteen hydroelectric plants, one combined cycle gas turbine plant, and eight fossil fuel plants in the Czech Republic. The company also operates various fossil fuel, hydro, wind, solar, gas, biogas, and biomass power plants in the Czech Republic; eleven wind power plants in Germany; and two fossil fuel plants and two hydroelectric plants in Poland. In addition, it is involved in the trade and sale of natural gas; mining of coal; quarrying and processing of construction aggregates and limestones; commodity trading business; and provision of energy services. Further, the company holds interest in the lithium ore mining project in C\u00ednovec. CEZ, a. s. was incorporated in 1992 and is headquartered in Prague, the Czech Republic.","Chennai Petroleum Corporation Limited produces and supplies petroleum products in India. The company's principal products include liquefied petroleum gas, motor spirit, superior kerosene oil, aviation turbine fuel, high speed diesel, naphtha, bitumen, hexane, mineral turpentine oil, lube base stock, petrochemical feedstocks, paraffin wax, and petcoke. It also provides furnace oil, sulphur, light diesel oil, extracts, and butene, isobutylene, and high viscosity index oil. In addition, the company offers linear alkyl benzene, methyl ethyl ketone, and propylene glycol and polyols. The company was formerly known as Madras Refineries Limited and changed its name to Chennai Petroleum Corporation Limited in June 2000. Chennai Petroleum Corporation Limited was incorporated in 1965 and is based in Chennai, India. Chennai Petroleum Corporation Limited operates as a subsidiary of Indian Oil Corporation Limited.","ContextVision AB (publ), a medical technology software company, provides image analysis and artificial intelligence software solutions to original equipment manufacturers in Asia, Europe, and the United States. The company offers image enhancement software for 2D/3D/4D ultrasound, radiography, magnetic resonance imaging (MRI), and mammography. Its products include Rivent that offers unparalleled image quality for various types of ultrasound systems for women's health, general imaging, cardiovascular, and point of care applications; VolarView, an image enhancement software for the handheld ultrasound market segment; and GOPiCE, a technology for volumetric image enhancement in real-time. The company also provides Altumira/Altumira Plus, a platform for digital radiography; and Orthopedic Package for orthopedic imaging. In addition, it offers GOPView MRI2Plus, an image enhancement solution for MRI; and INIFY Prostate Screening for digital analysis of prostate biopsies. The company was founded in 1983 and is headquartered in Stockholm, Sweden.","Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. The company also offers switching portfolio encompasses campus switching as well as data center switching; enterprise routing portfolio interconnects public and private wireline and mobile networks, delivering highly secure, and reliable connectivity to campus, data center and branch networks; wireless products include wireless access points and controllers; and compute portfolio including the cisco unified computing system, hyperflex, and software management capabilities, which combine computing, networking, and storage infrastructure management and virtualization. In addition, it provides Internet for the future product consists of routed optical networking, 5G, silicon, and optics solutions; collaboration products, such as meetings, collaboration devices, calling, contact center, and communication platform as a service; end-to-end security product consists of network security, cloud security, security endpoints, unified threat management, and zero trust; and optimized application experiences products including full stack observability and network assurance. Further, the company offers a range of service and support options for its customers, including technical support and advanced services and advisory services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.","DATA MODUL Aktiengesellschaft, Produktion und Vertrieb von elektronischen Systemen develops, manufactures, and distributes flatbed displays, monitors, electronic subassemblies, and information systems. It operates through two segments, Displays and Systems. The company manufactures and distributes TFT, touch, passive, epaper, customized, memory-in-pixel, and OLED displays. It also provides projected capacitive touch solutions, resistive touch screens, touch panels and sensors, and controller boards; firmware, cover glasses, and optical bonding solutions; human machine interface solutions; embedded components, single board computers, computer-on-modules, baseboards, memory and cooling solutions, and cables; and CPU boards, LCD controller boards, and embedded box PCs, as well as embedded computing design services. In addition, the company offers various monitors, panel PC solutions, and passenger information systems, as well as develops customized system solutions for various applications. It primarily serves customers in the mechanical engineering, medical device technology, automotive, industrial automation, and gaming industries in Germany and internationally. The company was founded in 1972 and is headquartered in Munich, Germany. DATA MODUL Aktiengesellschaft, Produktion und Vertrieb von elektronischen Systemen is a subsidiary of Arrow Central Europe Holding Munich GmbH.","Dynasty Ceramic Public Company Limited manufactures and sells ceramic wall and floor tiles in Thailand and internationally. It offers its products under the Dynasty, Tile Top, Jaguar, Value, Mustang, Chicken, Birdie, Ducky, Swan, M, Cosmo, Rover, and Monte brands. The company was formerly known as Royal Floor Tile Co. Ltd. Dynasty Ceramic Public Company Limited was founded in 1989 and is headquartered in Bangkok, Thailand.","DFV Deutsche Familienversicherung AG operates as a digital insurance company in Germany. It offers property, accident, liability, legal expense, household, pet health, and electronics insurance products; and dental, outpatient and inpatient treatment, foreign travel health, sick day, supplementary long-term care, and state-aided care provision insurance products. The company was incorporated in 2006 and is based in Frankfurt, Germany.","Dassault Syst\u00e8mes SE provides software solutions and services worldwide. It offers SOLIDWORKS design software for 3D design, electrical and printed circuit board design, product data management, simulation, manufacturing, and technical communication; CATIA, an engineering and design software for product 3D computer-aided design; GEOVIA for modeling and simulating the earth; and BIOVIA that provides the scientific community with advanced biological, chemical, and materials experiences. The company also provides SIMULIA that delivers realistic simulation applications; DELMIA, which enables global industrial operations; 3DVIA that provides 3D space planning solutions; and ENOVIA that enables to plan and track the definition of success for customer. In addition, it offers Centric PLM, a product lifecycle management software solution; 3DEXCITE, a real-time 3D visualization software; NETVIBES, which enables organizations to gather, align, and enrich big data; 3DEXPERIENCE platform that provides organizations a holistic and real-time view of their business activities and ecosystem, as well as connecting people, ideas, data, and solutions together in a single environment; and MEDIDATA, a clinical research study software that provides evidences and insights to pharmaceutical, biotech, medical device, and diagnostic companies, as well as academic researchers. Further, the company provides consulting, deployment, outcome based, and training services. It primarily serves companies in the transportation and mobility; industrial equipment; aerospace and defense; high-tech; life sciences and healthcare; energy and materials; home and lifestyle; construction, cities, and territories; consumer packaged goods and retail; marine and offshore; and business services sectors through distributors and resellers. Dassault Syst\u00e8mes SE was incorporated in 1981 and is headquartered in V\u00e9lizy-Villacoublay, France.","FNCB Bancorp, Inc. operates as the bank holding company for FNCB Bank that provides retail and commercial banking services to individuals, businesses, local governments, and municipalities in Northeastern Pennsylvania. The company offers checking, savings, money market, and certificate of deposit products. It also provides residential mortgage loans, and home equity term loans and lines of credit; construction, land acquisition, and development loans; commercial real estate loans; commercial and industrial loans; consumer loans, such as secured and unsecured installment loans, automobile financing, lines of credit, and overdraft protection loans; state and political subdivision loans and leases; and purchased loans. In addition, the company offers debit cards; mobile and telephone banking, check imaging, and electronic statement services; remote deposit capture, merchant, treasury, and purchasing card services; and wealth management services. As of January 28, 2022, it operated 17 community offices located in Lackawanna, Luzerne, and Wayne Counties. The company was formerly known as First National Community Bancorp, Inc. and changed its name to FNCB Bancorp, Inc. in October 2016. FNCB Bancorp, Inc. was founded in 1910 and is headquartered in Dunmore, Pennsylvania.","Greif, Inc. engages in the production and sale of industrial packaging products and services worldwide. It operates in three segments: Global Industrial Packaging; Paper Packaging &amp; Services; and Land Management. The Global Industrial Packaging segment produces and sells industrial packaging products, including steel, fiber, and plastic drums; rigid and flexible intermediate bulk containers; closure systems for industrial packaging products; transit protection products; water bottles, and remanufactured and reconditioned industrial containers; and various services, such as container life cycle management, filling, logistics, warehousing, and other packaging services to chemicals, paints and pigments, food and beverage, petroleum, industrial coatings, agriculture, pharmaceuticals, mineral product, and other industries. This segment also offers flexible intermediate bulk containers and related services to the agriculture, construction, and food industries. The Paper Packaging &amp; Services segment produces and sells containerboards, corrugated sheets and containers, and other corrugated and specialty products to customers in the packaging, automotive, food, and building products markets; and produces and sells coated and uncoated recycled paperboard, and recycled fiber. This segment's corrugated container products are used to ship various products, such as home appliances, small machinery, grocery products, automotive components, books, and furniture, as well as various other applications. The Land Management segment engages in harvesting and regeneration of timber properties; and sale of timberland and special use properties. As of October 31, 2021, this segment owned approximately 175,000 acres of timber properties in the southeastern United States. The company was formerly known as Greif Bros. Corporation and changed its name to Greif, Inc. in 2001. Greif, Inc. was founded in 1877 and is headquartered in Delaware, Ohio.","Gaming Innovation Group Inc., an iGaming technology company, together with its subsidiaries, provides solutions, products, and services to iGaming operators in Nordic countries, other European countries, and internationally. The company offers media services, such as operating various content rich websites, which empower potential players and connect them with their partners' casino or sports betting sites; and platform services, including providing gaming, betting, media, and turnkey platform solutions and services to operators and their customers, as well as specializes in taking land-based operators online through its omnichannel solution, which brings together the offline and online worlds through a shared loyalty system, wallet, and dual registration. It also provides Sportsbook, a sports betting omnichannel solution that offers a various digital content and sports events to players. In addition, the company offers managed service; omnichannel solutions; Data platform to enhance BI and make business decisions; Logic, a real-time rules engine that creates actionable business rules; marketing compliance solution; and Frontend solution. The company was founded in 2012 and is headquartered in St. Julian's, Malta.","Intellect Design Arena Limited provides software development and related services for banking, insurance, and other financial services in India and internationally. It offers platforms and products, such as iGTB, a suite of transaction banking solutions that includes digital transaction banking, trade and supply chain finance, liquid management, payment, and virtual account management solutions; iGCB, an end-to-end contextual banking suite for retail and corporate banking solution, which consists of digital core, digital lending, quantum core, and cards; iRTM, a risk, treasury, and capital markets platform that supports straight-through processing (STP) and various asset classes over a configurable and scalable platform; Intellect SEEC, an insurance solution; and Intellect WealthQube, a solution for wealth managers, private bankers, advisory firms, and financial advisors. Intellect Design Arena Limited was incorporated in 2011 and is based in Chennai, India.","Koppers Holdings Inc. provides treated wood products, wood preservation chemicals, and carbon compounds in the United States, Australasia, Europe, and internationally. The company operates through three segments: Railroad and Utility Products and Services (RUPS), Performance Chemicals (PC), and Carbon Materials and Chemicals (CMC). The RUPS segment procures and treats crossties, switch ties, and various types of lumber used for railroad bridges and crossings. It also provides rail joint bars to join rails together for railroads; transmission and distribution poles for electric and telephone utilities; and pilings. This segment also provides railroad services, such as engineering, design, repair, and inspection services for railroad bridges. The PC segment develops, manufactures, and markets copper-based wood preservatives, including micronized copper azole, micronized pigments, alkaline copper quaternary, amine copper azole, and chromated copper arsenate for decking, fencing, utility poles, construction lumber and timbers, and various agricultural uses; and supplies fire-retardant chemicals for pressure treatment of wood primarily in commercial construction. The CMC segment manufactures creosote for the treatment of wood or as a feedstock in the production of carbon black; carbon pitch, a raw material used in the production of aluminum and steel; naphthalene for use as a feedstock in the production of phthalic anhydride and as a surfactant in the production of concrete; phthalic anhydride for the production of plasticizers, polyester resins, and alkyd paints; and carbon black feedstock for use in the production of carbon black. The company serves the railroad, specialty chemical, utility, residential lumber, agriculture, aluminum, steel, rubber, and construction industries. Koppers Holdings Inc. was founded in 1988 and is headquartered in Pittsburgh, Pennsylvania.","Kriti Nutrients Limited engages in the manufacture and sale of soyabean seeds under the Kriti brand in India and internationally. It offers edible oils, such as refined sunflower oil, soya bean oil, filtered groundnut oil, and mustard oil; soya lecithin; protein-based nuggets/TVP, full fat soya flour, defatted flakes/ grits/ flour toasted, defatted flakes/ grits/ flour untoasted, super HyPro SBM, and soya hulls; and acid oil and fatty acids. The company serves food, pharmaceutical, aquaculture and poultry, and dairy industries. It also exports its products. The company was founded in 1992 and is based in Indore, India. Kriti Nutrients Limited is a subsidiary of Sakam Trading Private Limited.","Land and Houses Public Company Limited engages in the property development activities in Thailand and the United States. It operates in two segments, Real Estate Business, and Rental and Service Business. The company's Real Estate Business segment develops and sells single detached houses, townhouses, and residence condominium projects. Its Rental and Service Business segment is involved in the rental of shopping malls, hotels, and apartments. The company also offers project administration and management, and investment advisory services. Land and Houses Public Company Limited was founded in 1973 and is headquartered in Bangkok, Thailand.","Lojas Quero-Quero S.A. engages in the general retail trade activities in Brazil. It offers building materials, household appliances, and furniture. The company also provides credit card, extended warranties, and financial services. As of December 31, 2021, it operated approximately 465 stores in 377 cities. The company was founded in 1967 and is headquartered in Cachoeirinha, Brazil.","Multiplan Empreendimentos Imobili\u00e1rios S.A. engages in the planning, development, construction, and sale of real estate projects in Brazil. The company develops residential or commercial properties, including urban shopping malls. It is also involved in the purchase and sale of real estate properties, as well as acquisition and disposal of real estate rights, and its operation through leasing. In addition, the company provides management and administrative services for own or third party shopping malls; technical advisory and support services concerning real estate matters; and civil construction, construction works execution, and engineering and related services. Further, it engages in the planning, development, management, promotion, and intermediation of real estate projects; import and export of goods and services related to its activities; generation and sale of electric power; and acquisition of ownership interests and share control in other entities. The company was founded in 1974 and is based in Rio de Janeiro, Brazil.","NFC Public Company Limited, together with its subsidiaries, engages in the sale of chemical products and other chemical related services in Thailand. The company produces and sells ammonia, ammonium hydroxide, and sulfuric acid. It also offers wharf frontage, warehousing, logistics and liquid storage, yard, and port services. The company was formerly known as NFC Fertilizer Public Company Limited and changed its name to NFC Public Company Limited in June 2017. NFC Public Company Limited was incorporated in 1982 and is headquartered in Bangkok, Thailand.","NGL Energy Partners LP engages in the transportation, storage, blending, and marketing of crude oil, natural gas liquids, refined products / renewables, and water solutions. The company operates in three segments: Water Solutions, Crude Oil Logistics, and Liquids Logistics. The Water Solutions segment transports, treats, recycles, and disposes produced and flowback water generated from oil and natural gas production; aggregates and sells recovered crude oil; disposes solids, such as tank bottoms, and drilling fluid and muds, as well as performs truck and frac tank washouts; and sells produced water for reuse and recycle, and brackish non-potable water. The Crude Oil Logistics segment purchases crude oil from producers and marketers, and transports it to refineries for resale at pipeline injection stations, storage terminals, barge loading facilities, rail facilities, refineries, and other trade hubs; and provides storage, terminaling, and transportation services through pipelines. The Liquids Logistics segment supplies natural gas liquids, refined petroleum products, and biodiesel to commercial, retail, and industrial customers in the United States and Canada through its 24 terminals, third-party storage and terminal facilities, and nine common carrier pipelines, as well as through fleet of leased railcars. This segment is also involved in the marine export of butane through its facility located in Chesapeake, Virginia. NGL Energy Holdings LLC serves as the general partner of the company. The company was founded in 1940 and is headquartered in Tulsa, Oklahoma.","Patterson Companies, Inc. engages in distribution of dental and animal health products in the United States, the United Kingdom, and Canada. The company operates through three segments: Dental, Animal Health, and Corporate segments. The Dental segment offers consumable products, including infection control, restorative materials, and instruments; basic and advanced technology and dental equipment; practice optimization solutions, such as practice management software, e-commerce, revenue cycle management, patient engagement solutions, and clinical and patient education systems. It also provides a range of related services comprising software and design services, maintenance and repair, and equipment financing. The Animal Health segment distributes biologicals, pharmaceuticals, vaccines, parasiticides, diagnostics, prescription and non-prescription diets, nutritional's, consumable supplies, equipment, and software, as well as value-added services. This segment also provides private label portfolio of products to veterinarians, producers, and retailers under the Aspen, First Companion, and Patterson Veterinary brands. The Corporate segment offers customer financing services; and sells other miscellaneous products. It serves dentists, laboratories, institutions, other healthcare professionals, veterinarians, other animal health professionals, production animal operators, and animal health product retailers. The company was formerly known as Patterson Dental Company and changed its name to Patterson Companies, Inc. in June 2004. Patterson Companies, Inc. was founded in 1877 and is headquartered in Saint Paul, Minnesota.","Personal Group Holdings Plc provides short-term accident and health insurance services, SaaS products, and salary sacrifice technology products in the United Kingdom. The company operates through Affordable Insurance, Other Owned Benefits, Benefits and Platform, and Pay and Reward segments. It offers insurance products, including hospital plans, convalescence plans, and death benefit plans; and consultancy and software solutions on pay and reward services, as well as a suite of cloud-based Saas tools. The company also operates HAPI, a proprietary digital platform that allows employees to access financial, physical, mental, and social benefits; and Let's Connect, which enables employers to provide a benefit scheme that allows their employees to access consumer technology and other products from manufacturers through salary sacrifice. Personal Group Holdings Plc was founded in 1984 and is based in Milton Keynes, the United Kingdom.","Planet Labs PBC designs, constructs, and launches constellations of satellites with the intent of providing high cadence geospatial data delivered to customers through an online platform worldwide. The company offers Open Geospatial Consortium, a cloud-native proprietary technology that performs critical processing and overall harmonizing of images for time series and data fusion and analysis; and space-based hardware and related software systems. It serves agriculture, mapping, forestry, and finance and insurance, as well as federal, state, and local government bodies. The company was incorporated in 2010 and is headquartered in San Francisco, California.","Prologis, Inc. is the global leader in logistics real estate with a focus on high-barrier, high-growth markets. As of December 31, 2020, the company owned or had investments in, on a wholly owned basis or through co-investment ventures, properties and development projects expected to total approximately 984 million square feet (91 million square meters) in 19 countries. Prologis leases modern logistics facilities to a diverse base of approximately 5,500 customers principally across two major categories: business-to-business and retail/online fulfillment.","Far East H-Trust is a Singapore-Focused Hotel and Serviced Residence Hospitality Trust listed on the Main Board of The Singapore Exchange Securities Trading Limited (\u0093SGX-ST\u0094). Comprising Far East Hospitality Real Estate Investment Trust (\u0093Far East H-REIT\u0094) and Far East Hospitality Business Trust (\u0093Far East H-BT\u0094), Far East H-Trust was listed on the SGX-ST on 27 August 2012 and has a portfolio of 13 properties totaling 3,143 hotel rooms and serviced residence units valued at approximately S$2.65 billion as at 31 December 2019. Managed by FEO Hospitality Asset Management Pte. Ltd. and FEO Hospitality Trust Management Pte. Ltd. (collectively, the \u0093Managers\u0094) and sponsored by members of Far East Organization Group (the \u0093Sponsor\u0094), Far East H-Trust seeks to provide Stapled Securityholders with regular, stable and growing distributions on a quarterly basis. Far East H-Trust is listed on the FTSE ST Mid Cap Index.","Qualys, Inc. provides cloud-based information technology (IT), security, and compliance solutions in the United States and internationally. The company offers Qualys Cloud Apps, which includes Vulnerability Management; Vulnerability Management, Detection and Response; Threat Protection; Continuous Monitoring; Patch Management; Multi-Vector Endpoint Detection and Response; Certificate Assessment; SaaS Detection and Response; Secure Enterprise Mobility; Policy Compliance; Security Configuration Assessment; PCI Compliance; File Integrity Monitoring; Security Assessment Questionnaire; Out of-Band Configuration Assessment; Web Application Scanning; Web Application Firewall; Global Asset Inventory; Cybersecurity Asset Management; Certificate Inventory; Cloud Inventory; Cloud Security Assessment; and Container Security. Its integrated suite of IT, security, and compliance solutions delivered on its Qualys Cloud Platform enables customers to identify and manage IT assets, collect and analyze IT security data, discover and prioritize vulnerabilities, recommend and implement remediation actions, and verify the implementation of such actions. The company also provides asset tagging and management, reporting and dashboards, questionnaires and collaboration, remediation and workflow, big data correlation and analytics engine, and alerts and notifications, which enable integrated workflows, management and real-time analysis, and reporting across IT, security, and compliance solutions. The company offers its solutions through its sales teams, as well as through its network of channel partners, such as security consulting organizations, managed service providers, resellers, and consulting firms. It serves enterprises, government entities, and small and medium-sized businesses in various industries, including education, financial services, government, healthcare, insurance, manufacturing, media, retail, technology, and utilities. The company was incorporated in 1999 and is headquartered in Foster City, California.","Resource Development Group Limited provides contracting, remedial, and construction services to the resource, infrastructure, energy, government, utilities, and defense sectors in Australia. The company offers multi-disciplinary construction and remedial services, such as civil, SMPT, E&amp;I, and non-process infrastructure building works; ancillary and protective maintenance services; EPCM, PMC, or integrated team project delivery solutions; EPC project delivery solutions; design and construct package delivery solutions; and optimizing services comprising debottlenecking existing operations. It also holds interest in the Ant Hill and Sunday Hill manganese project; the Lucky Bay Garnet project and associated power infrastructure project, including seven wind turbines; and offers construction and plant modification services. The company was incorporated in 2011 and is headquartered in Perth, Australia. Resource Development Group Limited operates as a subsidiary of Mineral Resources Limited.","Realia Business, S.A., together with its subsidiaries, engages in property management and homebuilding activities in Spain and internationally. It develops, manages, operates, and leases office buildings, shopping centers, commercial premises, and industrial buildings; and provides land management services. It has a land portfolio of 6,946,216 gross square meters and 1,752,340 square meters of buildable land. The company was founded in 2000 and is headquartered in Madrid, Spain.","Romi S.A. manufactures and sells machine tools, plastic processing machines, and cast and machined cast iron parts in Brazil, Europe, Latin America, North America, Africa, and Asia. It operates through Romi Machines, Burkhardt+Weber Machines, and Castings for Industrial Applications segments. Its machine tools include turning and machine centers, vertical turning centers, drilling and threading center, CNC and universal lathes, vertical CNC lathes, heavy and extra heavy CNC lathes, and CNC boring machines. The company's plastic processing machines comprise injection molding machines and blowers. It is also involved in the manufacture and sale of industrial equipment and accessories, and tools and parts; and provision of systems analysis and data processing software development related to the production, commercialization, and use of machine tools and plastic machines. In addition, the company engages in the export and import activities; holds interest in other companies; and manages third party assets. Further, it provides spare parts and technical assistance; and machinery for specialized applications; engages in the real estate activities, including purchases and sales, and lease of company-owned properties, exploration of real estate rights, intermediation of real estate businesses, and provisions of sureties and guarantees; and grants lines of credit for financing of machines. Its products and services are used by various industries, such as automotive, wind energy, capital and consumer goods, packaging, tooling, agricultural machinery, hydraulic equipment, and sanitation. The company was formerly known as Ind\u00fastrias Romi S.A. Romi S.A. was founded in 1930 and is headquartered in Santa B\u00e1rbara d'Oeste, Brazil.","STMicroelectronics N.V., together with its subsidiaries, designs, develops, manufactures, and sells semiconductor products in Europe, the Middle East, Africa, the Americas, and the Asia Pacific. The company operates through Automotive and Discrete Group; Analog, MEMS and Sensors Group; and Microcontrollers and Digital ICs Group segments. The Automotive and Discrete Group segment offers automotive integrated circuits (ICs); and discrete and power transistor products. The Analog, MEMS and Sensors Group segment provides industrial application-specific integrated circuits (ASICs) and application-specific standard products (ASSPs); general purpose analog products; custom analog ICs; wireless charging solutions; galvanic isolated gate drivers; low and high voltage amplifiers, comparators, and current-sense amplifiers; MasterGaN, a solution that integrates a silicon driver and GaN power transistors in a single package; wireline and wireless connectivity ICs; touch screen controllers; micro-electro-mechanical systems (MEMS) products, including sensors or actuators; and optical sensing solutions. The Microcontrollers and Digital ICs Group segment offers general purpose and secure microcontrollers; radio frequency (RF) and electrically erasable programmable read-only memories; and RF, digital, and mixed-signal ASICs. It also provides assembly and other services. The company sells its products through distributors and retailers, as well as through sales representatives. It serves automotive, industrial, personal electronics and communications equipment, and computers and peripherals markets. STMicroelectronics N.V. was incorporated in 1987 and is headquartered in Geneva, Switzerland.","Shriram Finance Limited, a non-banking finance company, primarily provides commercial vehicle financing services in India. It offers commercial vehicle loans for commercial goods vehicles, passenger vehicles, tractors and farm equipment, and construction equipment. The company also provides business loans; fixed and recurring deposits; and working capital loans, including tyre, tax, fuel, and toll finance, as well as vehicle insurance and repair/top-up loans. In addition, it offers challan discounting services; life and general insurance products; consumer finance services; emergency credit line guarantee schemes; stock broking services; and chit and mutual funds. As of March 31, 2022, it operated a network of 1,854 branches. The company also offers its products through 775 rural centers; and partnerships with 500 private financiers. It primarily serves first time buyers, driver-turned-owners, and small road transport operators. The company was formerly known as Shriram Transport Finance Company Limited and changed its name to Shriram Finance Limited in November 2022. Shriram Finance Limited was incorporated in 1979 and is headquartered in Mumbai, India.","Siebert Financial Corp., through its subsidiaries, engages in the retail discount brokerage and investment advisory businesses in the United States and Internationally. It offers discount brokerage services, including self-directed trading, wealth management, financial advice, market making and fixed income investment, stock borrow, equity compensation plans, securities lending, equity stock plan, and market making services; independent retail execution services; and retail customer services. The company also offers self-directed retirement accounts, as well as lends customers a portion of the market value of marginable securities held in the customer's account. In addition, the company provides data technology platform that offers various services, such as email and messaging, market data systems and third party trading systems, business productivity tools, and customer relationship management systems. Further, it offers a Robo-Advisor platform that provides clients with an automated wealth management solution; and various insurance products, such as fixed annuities, personal insurance, property and casualty insurance, natural disaster insurance, and life and disability. The company has 12 branch offices in the United States. Siebert Financial Corp. was incorporated in 1934 and is headquartered in New York, New York.","Strike Energy Limited explores for and develops oil and gas resources in Australia. The company primarily focuses on the Project Haber, Ocean Hill, Perth Basin Geothermal, Walyering, West, and South Erregulla projects located in the Perth Basin. Strike Energy Limited was incorporated in 1997 and is based in West Perth, Australia.","SurgePays, Inc., a financial technology and telecommunications company, provides services to the underbanked community in the United States. Its blockchain platform utilizes a suite of financial and prepaid products to convert corner stores and bodegas into tech-hubs for underbanked neighborhoods. The company offers voice and SMS text messaging services to subsidized and direct retail prepaid customers, as well as to low-income consumers. It also offers subsidized mobile broadband services to consumers in California, Colorado, Florida, Illinois, Maryland, Mississippi, Missouri, Nevada, New Jersey, Ohio, Oklahoma, Rhode Island, Tennessee, and Texas, as well as prepaid wireless plans. In addition, the company provides marketing business intelligence, plaintiff generation, and case load management solutions primarily to law firms in the mass tort industry. Further, it operates a bilingual operations center offering the Company with sales support, customer service, IT infrastructure design, graphic media, database programming, software development, revenue assurance, lead generation, and other various operational support services. The company is headquartered in Bartlett, Tennessee.","SurgePays, Inc. operates as a technology and telecommunications company. It offers mobile broadband services to consumers. The company's fintech platform utilizes a suite of financial and prepaid products to convert corner stores and bodegas into tech-hubs for underbanked neighborhoods. The company also provides ShockWave, an end-to-end cloud-based Software as a Service offering an Omnichannel customer relationship management, billing system, and carrier integrations to the telecommunication and broadband industry. In addition, the company provides Surge Blockchain software, a back-office marketplace offering wholesale consumable goods direct to convenience stores who are transacting on the SurgePays Fintech platform. Further, it offers lead generation and case management solutions primarily to law firms in the mass tort industry. The company was incorporated in 2006 and is headquartered in Bartlett, Tennessee.","Codex DNA, Inc., a synthetic biology company, manufactures and sells synthetic biology instruments, reagents, and associated products and related services, primarily to pharmaceutical and academic laboratories worldwide. Its solutions include BioXp system that empowers researchers to go from a digital DNA sequence to endpoint-ready synthetic DNA; BioXp portal, an online portal that offers an intuitive guided workflow and design tools for building new DNA sequences and assembling them into vectors of choice; BioXp kits that contain building blocks and reagents, including its Gibson Assembly branded reagents, for specific synthetic biology workflow applications; Cloud-based scripts; Benchtop reagents that contain all the reagents necessary to proceed with a specific synthetic biology workflow on the benchtop using products generated on the BioXp system; Biofoundry Services, which enable a customer to order and receive the BioXp system endpoint-ready products, such as genes, clones, cell-free amplified DNA, and variant libraries; and short oligo ligation assembly enzymatic DNA synthesis. It also serves government institutions, contract research organizations, and synthetic biology companies. The company was formerly known as SGI-DNA, Inc. and changed its name to Codex DNA, Inc. in March 2020. Codex DNA, Inc. was incorporated in 2011 and is headquartered in San Diego, California.","Target Hospitality Corp. operates as a specialty rental and hospitality services company in North America. The company operates through four segments: Hospitality &amp; Facilities Services - South, Hospitality &amp; Facilities Services - Midwest, Government, and TCPL Keystone. It owns a network of specialty rental accommodation units with approximately 15,528 beds across 27 communities, which include 26 owned and 1 leased; and operates 1 community not owned or leased by the company. Target Hospitality Corp. also provides catering and food, maintenance, housekeeping, grounds-keeping, security, health and recreation, workforce community management, concierge, and laundry services. It serves the U.S. government, government contractors, investment grade natural resource development companies, and energy infrastructure companies. The company was founded in 1978 and is headquartered in The Woodlands, Texas.","Thai Rung Union Car Public Company Limited engages in the car assembly and modification, and the manufacture and distribution of parts and molds primarily in Thailand. It operates through three segments: Car Assembly and Other Related Car Services; Manufacture of Equipment for Production of Car Accessories; and Sales of Cars, and Car Service Centre Business. The company offers tooling products, including dies and molds, and assembly jigs and checking fixtures; auto parts, such as metal stamping or press parts for use in producing or assembling motor vehicles, motorcycles, industrial, construction and agricultural machinery, and electrical appliances; plastic vacuum mould parts for auto accessories; and auto seats. It also provides contract assembly, vehicle modification, and vehicle painting services; and after-sales services. In addition, the company is involved in the sale of cars, car accessories, and spare parts; repairing and refitting vehicles body; and manufacture of truck bodies, such as dump-trucks, cargo vans, trailers, concrete mixer trucks, refrigerated trucks, industrial machinery, excavators, construction equipment, agricultural machinery, and tractors. Thai Rung Union Car Public Company Limited was founded in 1967 and is headquartered in Bangkok, Thailand.","Ultrapar Participa\u00e7\u00f5es S.A. engages in the gas distribution, fuel distribution, and storage businesses primarily in Brazil, Mexico, Uruguay, Venezuela, other Latin American countries, the United States, Canada, the Far East, Europe, and internationally. Its Gas Distribution segment distributes liquefied petroleum gas to residential, commercial, and industrial consumers primarily in the South, Southeast, and Northeast regions of Brazil. The company's Fuel Distribution segment distributes and markets gasoline, ethanol, diesel, fuel oil, kerosene, natural gas for vehicles, and lubricants; operates convenience stores; and offers lubricant-changing and automotive specialized services. The company's Storage segment operates liquid bulk terminals primarily in the Southeast and Northeast regions of Brazil. As of December 31, 2021, the company operated through 7,104 Ipiranga service stations and 1,841 AmPm convenience stores; 1,149 Jet Oil franchises; 4 distribution centers; and 7 Ultracargo terminals with storage capacity of 983 thousand cubic meters. It also operates Abastece A\u00ed, a digital payments app; and offers Km de Vantagens, a loyalty program. The company was founded in 1937 and is headquartered in S\u00e3o Paulo, Brazil.","Puranium Energy Ltd. operates as a uranium exploration company in Canada, Australia, and the Philippines. The company has 85% interests in the seven exclusive prospecting licenses covering an area of 93,514 hectares located in Namibia, Africa. It holds a 100% interest in the Cobalt Mountain property covering an area of approximately 4,921 hectares located in the Omineca mining division of Northwest British Columbia; and has an option to purchase a 100% interest in Haines Property comprising 35 minerals claims located in Ontario, Canada. The company was formerly known as Monterey Minerals Inc. and changed its name to Puranium Energy Ltd. in March 2022. Puranium Energy Ltd. is headquartered in Vancouver, Canada.","VICOM Ltd, an investment holding company, provides motor vehicle inspection, non-vehicle testing, and consultancy services in Singapore. The company offers vehicle inspection services, including inspection for petrol-driven and diesel-driven vehicles, petrol-hybrid and diesel hybrid vehicles, motorcycles, electric vehicles, power assisted bicycles, and e-scooters; vehicle assessment services; and emission test laboratory services. It also provides vehicle evaluation; motor and general insurance; road tax renewal; and other services, such as vehicle inspection and type approval system, in-vehicle unit, speed limiter check, chassis dynamometer smoke test, and car buying tips and maintenance talks services. The company offers its testing, calibration, inspection, consultancy, and training services to aerospace, marine and offshore, biotechnology, oil and petrochemical, building construction, and electronics manufacturing industries. VICOM Ltd was incorporated in 1981 and is based in Singapore. VICOM Ltd is a subsidiary of ComfortDelGro Corporation Limited.","WT Financial Group Limited provides a range of financial services. It operates in two segments, Business to Business and Direct to Consumer. The company provides, licensing, risk management and compliance, education and training, and technical support services; and practice management and development services, including consumer marketing and education tools. It also offers financial planning, investment, and product sales and licensing services; and mortgage finance and brokerage, accounting, and SMSF administration services. In addition, the company provides wealth management, retirement, and investment, as well as mortgage, tax, and finance advice; and tax planning and structuring, and preparation and lodgement of tax returns. Further, it provides superannuation investments, insurance, finance, equities, and direct and SMSF residential and commercial properties to retail and wholesale clients; and home loan solutions for private wealth clients. The company was formerly known as Spring FG Limited and changed its name to WT Financial Group Limited in November 2019. WT Financial Group Limited was incorporated in 2014 and is based in Sydney, Australia."],"shape":[139],"dtype":"object","or
